INSERT INTO `songs` (`song_id`, `song_title`, `artist_id`, `lyrics`, `song_type`, `s_type`, `wedding_song`, `key_c`, `location`, `created`, `sipra_status`) VALUES
(2, 'Closer', 7, '<pre class=\"_3F2CP _3hukP\"><span class=\"_3rlxz\">[Intro]\r\n</span><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span> <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span> <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span> <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span> <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span> <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span> <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span> \r\n<span class=\"_3rlxz\">[Verse 1]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>              <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>                  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Hey, I was doing just fine before I met you\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">            <span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>                    <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>           <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">I drank too much and that\'s an issue but I\'m okay\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>            <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>                          <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Hey, you tell your friends it was nice to meet them\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">      <span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>         <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>             <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">But I hope I never see them again\r\n</span></span> \r\n<span class=\"_3rlxz\">[Pre-Chorus]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>               <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">   I know it breaks your heart\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>                          <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Moved to the city in a broke down car and\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>             <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">   Four years, no calls\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>                            <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Now you\'re looking pretty in a hotel bar and\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>       <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">I    can\'t stop\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">    <span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>       <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">No, I    can\'t stop\r\n</span></span> \r\n<span class=\"_3rlxz\">[Chorus]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">   <span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>           <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>          <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>                <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">So baby pull me closer in the backseat of your Rover\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">       <span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>              <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">That I know you can\'t afford\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">          <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>            <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Bite that tattoo on your shoulder\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">         <span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>                   <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Pull the sheets right off the corner\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">       <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>                  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Of the mattress that you stole\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">          <span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>                   <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">From your roommate back in Boulder\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">         <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>              <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">We ain\'t ever getting older\r\n</span></span> \r\n<span class=\"_3rlxz\">[Post-Chorus]\r\n</span><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span> <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span> <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span> <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span> \r\n<span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>    <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>         <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>                <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">          We ain\'t ever getting older\r\n</span></span> \r\n<span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span> <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span> <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span> <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span> \r\n<span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>    <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>         <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>                <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">          We ain\'t ever getting older\r\n</span></span> \r\n<span class=\"_3rlxz\">[Verse 2]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Cadd9\">Cadd9</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>         <span class=\"_3PpPJ OrSDI\" data-name=\"Em7\">Em7</span>                       <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">You, look as the good as the day as I met you\r\n</span></span><span class=\"_2jIGi\"><span class