(6, 'The Man Who Cant Be Moved', 5, '<pre class=\"_3F2CP _3hukP\"><span class=\"_3rlxz\">[Intro]\r\n</span><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>  <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span> \r\n<span class=\"_3rlxz\">[Verse]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">       <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                       <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">Going back to the corner where I first saw you,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">     <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                               <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">Gonna camp in my sleeping bag, no I\'m not gonna move,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">      <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                       <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">Got some words on cardboard got your picture in my hand,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">     <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                               <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">Saying if you see this girl can you tell her where I am,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">           <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                       <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">Some try to hand me money they don\'t understand,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">            <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                               <span class=\"_3PpPJ OrSDI\" da