  <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>       <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">I\'m not moving.\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>        <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">So I\'m not moving...\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>       <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">I\'m not moving.\r\n</span></span> \r\n<span class=\"_3rlxz\">[Interlude]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Em\">Em</span>                   <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>\r\n</span><span class=\"_3rlxz\">People talk about the guy\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">       <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">Who\'s waiting on a girl...\r\n</span></span> \r\n<span class=\"_3rlxz\">Oohoohwoo\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Em\">Em</span>                         <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>\r\n</span><span class=\"_3rlxz\">There are no holes in his shoes\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">          <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">But a big hole in his world...\r\n</span></span> \r\n<span class=\"_3rlxz\">Hmmmm\r\n</span> \r\n<span class=\"_3rlxz\">[Bridge]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Em\">Em</span>                 <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Maybe I\'ll get famous as the man who can\'t be moved,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                        <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>              <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">And maybe you won\'t mean to but you\'ll see me on the news,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Em\">Em</span>                              <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">And you\'ll come running to the corner...\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\"><span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>\r\n</span><span class=\"_3rlxz\">\'Cause you\'ll know it\'s just for you\r\n</span></span> \r\n<span class=\"_3rlxz\">I\'m the man who can\'t be moved\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">          <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">I\'m the man who can\'t be moved...\r\n</span></span> \r\n<span class=\"_3rlxz\">[Pre-Chorus]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">           <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                                 <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">\'Cause if one day you wake up and find that you\'re missing me,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">           <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                                   <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">And your heart starts to wonder where on this earth I can be,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">         <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                                 <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">Thinking maybe you\'d come back here to the place that we\'d meet,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">           <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                             <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>             <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">And you\'d see me waiting for you on the corner of the street.\r\n</span></span> \r\n<span class=\"_3rlxz\">[Chorus]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>        <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">So I\'m not moving...\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>       <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">I\'m not moving.\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>        <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">So I\'m not moving...\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>       <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">I\'m not moving.\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>        <span class=\"_3PpPJ OrSDI\" data-name=\"D\">D</span>\r\n</span><span class=\"_3rlxz\">So I\'m not moving...\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">        <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>       <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">I\'m not moving.\r\n</span></span> \r\n<span class=\"_3rlxz\">[Outro]\r\n</span><span class=\"_2jIGi\"><span class=\"_3rlxz\">      <span class=\"_3PpPJ OrSDI\" data-name=\"G\">G</span>                          <span class=\"_3PpPJ OrSDI\" data-name=\"D/F#\">D/F#</span>\r\n</span><span class=\"_3rlxz\">Going back to the corner where I first saw you,\r\n</span></span><span class=\"_2jIGi\"><span class=\"_3rlxz\">       <span class=\"_3PpPJ OrSDI\" data-name=\"Am\">Am</span>                             <span class=\"_3PpPJ OrSDI\" data-name=\"C\">C</span>\r\n</span><span class=\"_3rlxz\">Gonna camp in my sleeping bag, no I\'m not gonna move.</span></span></pre>', 'fast song', 15, 'no', 'Bb', 'local', '2022-02-12 02:17:52', ''),
(7, 'Binibini', 4, '<div class=\"Lyrics__Container-sc-1ynbvzw-6 jYfhrf\" data-lyrics-container=\"true\">[Verse 1]<br />You give me hope<br />For strength, the will to keep on<br />No one else can make me feel this way<br />And only you can bring out all the best I can do<br />I believe you turned the tide<br />And make me feel real good inside<br /><br />[Verse 2]<br />You pushed me up<br />When I\'m about to give up<br />You\'re on my side<br />When no one seems to listen<br />And if you go, you know the tears can\'t help but show<br />You\'ll break this heart and tear it apart<br />And suddenly the madness starts<br /><br />[Chorus]<br />It\'s your smile, your face, your lips that I miss<br />Those sweet little eyes that stare at me<br />And make me say, I\'m with you through all the way<br />\'Cause it\'s you who fills the emptiness in me<br />It changes everything you see<br />When I know I\'ve got you with me<br /><br />[Verse 3]<br />You pushed me up<br />When I\'m about to give up<br />You\'re on my side<br />When no one seems to listen<br />And if you go, you know the tears can\'t help but show<br />You\'ll break this heart and tear it apart<br />And suddenly the madness starts</div>\r\n<div class=\"RightSidebar__Container-pajcl2-0 kwgaZp\">&nbsp;</div>\r\n<div class=\"InreadAddesktop__Container-j86wd6-0 focHlE\">&nbsp;</div>\r\n<div class=\"Lyrics__Container-sc-1ynbvzw-6 jYfhrf\" data-lyrics-container=\"true\">[Chorus]<br />It\'s your smile, your face, your lips that I miss<br />Those sweet little eyes that stare at me<br />And make me say, I\'m with you through all the way<br />\'Cause it\'s you who fills the emptiness in me<br />It changes everything you see<br />When I know I\'ve got you with me<br /><br />It\'s your smile, your face, your lips that I miss<br />Those sweet little eyes that stare at me<br />And make me say, I\'m with you through all the way<br />\'Cause it\'s you who fills the emptiness in me<br />It changes everything you see<br />When I know I\'ve got you with me</div>', 'fast song', 20, 'no', 'F', 'foreign', '2022-02-12 02:17:52', ''),
