(44, 'Bad day', 33, '<p>Original key = Eb</p>\r\n<p>[Intro]<br />&gt;D G A <br /> <br />[Verse 1]<br />&gt;D/A Gadd9 A <br /> Where is the moment when we need it the most <br />&gt;D/A Gadd9 A <br /> You kick up the leaves and the magic is lost<br />&gt;Bm A G<br /> They tell me your blue sky\'s faded to grey<br />&gt; D/F#m Em<br />The tell me your passion\'s gone away<br />&gt; A <br />And I don\'t need no carrying on <br /> <br />&gt;D/A Gadd9 A <br /> Stand in line just to hit a new low.<br />D/A Gadd9 A <br /> You\'re faking a smile with the coffee you go <br />&gt;Bm A G<br /> You tell me your life\'s been way off line <br />&gt; D/F#m Em<br />You\'re falling to pieces everytime<br />&gt; A<br />And I don\'t need no carrying on<br /> <br /> <br />[Chorus]<br />&gt; D<br />Cause you had a bad day <br />&gt; G<br />You\'re taking one down <br />&gt; Em A<br />You sing a sad song just to turn it around<br />&gt; D<br />You say you don\'t know <br />&gt; G<br />You tell me don\'t lie<br />&gt; Em A<br />You work at a smile and you go for a ride <br />&gt; Bm<br />You had a bad day<br />&gt; A<br />The camera don\'t lie<br />&gt; G D/F#m<br />You\'re coming back down and you really don\'t mind<br />&gt; Em A<br />You had a bad day<br />&gt; D<br />You had a bad day <br /> <br /> <br />[Fill]<br /> <br />&gt;D G A <br /> <br />&gt;D G A <br /> <br />&gt;Bm A G<br />Well you need a blue sky holiday<br />&gt; D/F#m Em<br />The point is they laugh at what you say <br />&gt; A<br />And I don\'t need no carrying on <br /> <br /> <br />[Chorus]<br />&gt; D<br />Cause you had a bad day <br />&gt; G<br />You\'re taking one down <br />&gt; Em A<br />You sing a sad song just to turn it around <br />&gt; D<br />You say you don\'t know <br />&gt; G<br />You tell me don\'t lie<br />&gt; Em A<br />You work at a smile and you go for a ride <br />&gt; Bm<br />You had a bad day<br />&gt; A<br />The camera don\'t lie<br />&gt; G D<br />You\'re coming back down and you really don\'t mind <br />&gt; Em <br />You had a bad day <br /> <br /> <br />[Bridge]<br />&gt;F<br />Sometimes the system goes on the blink<br />&gt; Bb<br />And the whole thing it turns out wrong <br />&gt; F<br />You might not make it back and you know <br />&gt; Bb<br />That you could be well oh that strong <br />&gt; A <br />Well I\'m not wrong</p>\r\n<p><br /> <br />&gt;D G A<br />So where is the passion when you need it the most <br /> <br />Oh you and I<br />&gt;D G A<br />You kick up the leaves and the magic is lost <br /> <br /> <br />[Final-Chorus]<br />&gt; D<br />Cause you had a bad day <br />&gt; G<br />You\'re taking one down <br />&gt; Em A<br />You sing a sad song just to turn it around <br />&gt; D<br />You say you don\'t know <br />&gt; G<br />You tell me don\'t lie<br />&gt; Em A<br />You work at a smile and you go for a ride <br />&gt; Bm<br />You had a bad day<br />&gt; Bb<br />It seem what you like <br />&gt; A E/G#<br />And how does it feel for one more time <br />&gt; G A<br />You had a bad day<br />&gt; D G Em A x4 (fade out)<br />had a bad day</p>', 'first set', 1, 'no', 'D', '', '2022-02-12 02:17:52', ''),
