r />&gt;Bb Gm<br />And when she\'s talking<br />&gt; Am7-5 D7<br />She\'ll say that she\'s mine<br />&gt;G Em<br />She\'ll say I\'m not so tough<br />&gt;Am<br />Just because<br />&gt;A<br />I\'m in love with an<br /> <br /> <br />[Verse]<br /> <br />&gt;D<br />Uptown girl<br />&gt;Em D/F#<br /> She\'s been living in her white bread world<br />&gt;G A D<br /> As long as anyone with hot blood can<br />&gt;Em D/F#<br /> And now she\'s looking for a downtown man<br />&gt;G A<br /> That\'s what I am<br /> <br /> <br />[Interlude]<br /> <br />&gt;F G G#mdim Am G<br /> Oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh<br />&gt;F G G#mdim A<br /> Oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh, oh<br /> <br /> <br />[Outro]<br /> <br />&gt;D<br />Uptown girl<br />&gt;Em D/F#<br /> She\'s my uptown girl<br />&gt; G A<br />You know I\'m in love<br />&gt; D<br />With an uptown girl<br />&gt;Em D/F#<br />My uptown girl<br />&gt; G A<br />You know I\'m in love<br />&gt; D<br />With an uptown girl<br />&gt;Em D/F#<br />My uptown girl<br />&gt; G A<br />You know I\'m in love<br />&gt; D<br />With an uptown girl<br />&gt;Em D/F#<br />My uptown girl<br /> <br />(repeat and fade)</p>', 'upbeat', 3, 'no', 'E', '', '2022-02-12 02:17:52', ''),
