(337, '100 years', 129, '<div class=\"ujudUb\">I\'m 15 for a moment<br />Caught in between ten and 20<br />And I\'m just dreaming<br />Counting the ways to where you are</div>\r\n<div class=\"ujudUb\">I\'m 22 for a moment<br />And she feels better than ever<br />And we\'re on fire<br />Making our way back from Mars</div>\r\n<div class=\"ujudUb\">15, there\'s still time for you<br />Time to buy and time to lose<br />15, there\'s never a wish better than this<br />When you\'ve only got a hundred years to live</div>\r\n<div class=\"ujudUb\">I\'m 33 for a moment<br />I\'m still the man, but you see I\'m a \"they\"<br />A kid on the way, babe<br />A family on my mind</div>\r\n<div class=\"ujudUb\">I\'m 45 for a moment<br />The sea is high<br />And I\'m heading into a crisis<br />Chasing the years of my life</div>\r\n<div class=\"ujudUb\">15, there\'s still time for you<br />Time to buy and time to lose yourself within a morning star<br />15, I\'m alright with you<br />15, there\'s never a wish better than this<br />When you\'ve only got a hundred years to live</div>\r\n<div class=\"ujudUb\">Half time goes by, suddenly you\'re wise<br />Another blink of an eye, 67 is gone<br />The sun is getting high<br />We\'re moving on</div>\r\n<div class=\"ujudUb\">I\'m 99 for a moment<br />And dying for just another moment<br />And I\'m just dreaming<br />Counting the ways to where you are</div>\r\n<div class=\"ujudUb\">15, there\'s still time for you<br />22, I feel her too<br />33, you\'re on your way<br />Every day\'s a new day</div>\r\n<div class=\"ujudUb\">Ooh-ooh, ooh-ooh-ooh<br />Ooh-ooh, ooh-ooh-ooh<br />Ooh-ooh, ooh-ooh-ooh, ooh-ooh-ooh<br />Ooh</div>\r\n<div class=\"ujudUb WRZytc\">15, there\'s still time for you<br />Time to buy and time to choose<br />Hey, 15, there\'s never a wish better than this<br />When you\'ve only got a hundred years to live</div>', 'fast song', 21, 'no', 'G', '', '2023-12-02 05:29:58', ''),
