(599, 'Beep beep beep beep', 373, '<p>[Intro]<br /> <br />E (x4)<br /> <br /> <br />[Verse 1]<br /> <br />E<br />Beep beep ,beep ang sabi ng tsuper ng jeepney<br />Beep beep ,beep tabi kayo baka kayo maiipit<br />E D F G<br />Sakay na kayo kahit hanggang kanto<br />E D - F G<br />Ang buhay ng tsuper ay hindi gawang biro<br /> <br />E (x2)<br /> <br /> <br />[Chorus]<br /> <br />E<br />Beep beep ,beep dadalhin ko kayo kahit saan<br />Beep beep ,beep dalian ninyo hindi pa ako na nanghalian<br />Sakay na kayo kahit hanggang kanto<br />Ang buhay ng tsuper ay hindi gawang biro<br />F-E<br /> Ohh!! naku ang hirap namang magdrive ng buong hapon<br />F-E<br /> Mainit pa<br />F-E<br /> Ay naku kailangan pa akong pumila<br />F-E<br /> Para ako&rsquo;y makapagmiriyenda Ha -Ha- Ha -Ha<br /> <br /> <br />[Instrumental]<br /> <br />E (7x) then E - D- F -G (2x)<br /> <br /> <br />[Intro]<br /> <br />E (x4) Oyyy<br /> <br /> <br />[Chorus]<br />(same chords)<br /> <br />Beep, beep, beep oras na ng reliyebo<br />Beep, beep, beep naghihintay na ang pamilya ko<br />Sakay na kayo kahit hanggang kanto<br />Ang buhay ng tsuper ay hindi gawang biro<br /> <br />Sakay na kayo kahit hanggang kanto<br />Ang buhay ng tsuper ay hindi gawang biro<br /> <br />Sakay, sakay na kayo kahit hanggang kanto lang<br />Ang buhay ng tsuper ay hindi gawang biro<br /> <br />Hoy, hoy, hoy (To Fade)</p>', 'opm rock', 13, 'no', 'Em', '', '2022-02-12 02:17:52', ''),
