(693, 'Autumn leaves', 81, '<p>Original key = Gm</p>\r\n<p>[Intro]<br /> <br />&gt;Em7 G/F# G Cadd9<br />(2x)<br /> <br /> <br />[Verse]<br /> <br />&gt;Em7 G/F# G<br />Another day, another life <br />&gt; Cadd9 Em7<br />Passes by just like mine <br />&gt; G/F# G Cadd9<br />It\'s not complicated <br /> <br />&gt;Em7 G/F# G<br />Another mind, another soul <br />&gt; Cadd9 Em7<br />Another body to grow old <br />&gt; G/F# G Cadd9<br />It\'s not complicated <br /> <br />&gt;Cadd9 D<br />Do you ever wonder if the stars shine out for you? <br /> <br /> <br />[Chorus]<br /> <br />&gt;G G/F#<br />Float down<br />&gt;Em7 Cadd9<br />Like autumn leaves <br />&gt;G G/F#<br />Hush now <br />&gt;Em7 Cadd9<br />Close your eyes before the sleep<br />&gt;G G/F# Em7 Cadd9 G<br />And you\'re miles away, and yesterday <br />&gt;G/F# Em7 Cadd9<br />You were here with me <br /> <br /> <br />[Interlude]<br /> <br />&gt;Em7 G/F# G Cadd9<br />&gt;Em7 G/F# G Cadd9<br /> <br /> <br />[Verse]<br /> <br />&gt;Em7 G/F# G<br />Another tear, another cry <br />&gt; Cadd9 Em7<br />Another place for us to die <br />&gt; G/F# G Cadd9<br />It\'s not complicated <br /> <br />&gt;Em7 G/F# G<br />Another life that\'s gone to waste <br />&gt; Cadd9 Em7<br />Another light lost from your face <br />&gt; G/F# G Cadd9<br />It\'s complicated <br /> <br />&gt;Cadd9 D<br />Is it that it\'s over or do birds still sing for you? <br /> <br /> <br />[Chorus]<br /> <br />&gt;G G/F#<br />Float down<br />&gt;Em7 Cadd9<br />Like autumn leaves <br />&gt;G G/F#<br />Hush now <br />&gt;Em7 Cadd9<br />Close your eyes before the sleep<br />&gt;G G/F# Em7 Cadd9 G<br />And you\'re miles away, and yesterday <br />&gt;G/F# Em7 Cadd9<br />You were here with me <br /> <br /> <br />[Bridge]<br /> <br />&gt;Am Cadd9<br />Ooh, how I miss you <br />&gt; G F#m<br />My symphony played the song that carried you out <br />&gt;Am Cadd9<br />Ooh how I miss you <br />&gt; G F#m<br />I miss you and I wish you\'d stay <br /> <br />&gt;Cadd9 D<br />Do you ever wonder if the stars shine out for you? <br /> <br /> <br />[Chorus]<br /> <br />&gt;G G/F#<br />Float down<br />&gt;Em7 Cadd9<br />Like autumn leaves <br />&gt;G G/F#<br />Hush now <br />&gt;Em7 Cadd9<br />Close your eyes before the sleep<br />&gt;G G/F# Em7 Cadd9 G<br />And you\'re miles away, and yesterday <br />&gt;G/F# Em7 Cadd9<br />You were here with me <br /> <br /> <br />[Bridge]<br /> <br />&gt;Em7 G G/F#<br />Ooh oh, ooh oh <br />&gt;Em7 G G/F#<br />Ooh oh, ooh oh <br /> <br /> <br />[Outro]<br /> <br />&gt;G G/F# Em7<br />Touch down <br />&gt; Cadd9<br />Like a seven four seven <br />&gt;G G/F# Em7 A7sus4<br />Stay out and we\'ll live forever now</p>', 'first set', 22, 'no', 'Bb', '', '2022-02-12 02:17:52', ''),
