(701, 'Love Team', 39, '<p>Intro<br />&gt;G - D (3X)<br />&gt;A</p>\r\n<p>[Verse I]<br /> <br />&gt;D Ddim Bm<br />di naman talaga tayo magsinta<br />&gt; E Em<br />pero gusto nila<br />&gt; Gm C D<br />kahit ayaw mo bagay daw tayo<br />&gt; Ddim Bm<br />di naman totoo mga yakap mo<br />&gt; E Em<br />pang-eksena lamang ito<br />&gt; Gm C<br />di mo lang alam<br />&gt; D E7<br />na nababaliw na&rsquo;ko sa iyo<br />&gt; D E7<br />di ko na yata kaya to<br />&gt; D E7<br />ang aking lihim na pakay<br />&gt; D A7<br />ay ang lahat ng ito&rsquo;y gawing tunay<br /> <br /> <br />[Chorus]<br /> <br />&gt;G<br />Sana wag mong sisihin<br />&gt; Gm<br />kung di ko kayang pigilin<br />&gt;D<br />sabi mo na mahal mo &lsquo;ko<br />&gt; B7<br />ngunit di naman seryoso<br />&gt;Em<br />sana magkasingkulay<br />&gt; Gm D<br />ang drama at tunay na buhay ko<br />&gt;Bm Em<br />ang tanging pag-asa ko<br />&gt; A7<br />ay nasa tambalang ito<br /> <br />&gt;G - D - A<br /> <br /> <br />[Verse II]<br /> <br />&gt;D Ddim<br />Sinungaling ka<br />&gt; Bm E Em<br />kapag may tao ay nilalambing mo ko<br />&gt; Gm C D Ddim<br />pero pag wala ay sumasama ng turing mo sa &lsquo;kin<br />&gt; Bm E Em<br />ay parang hanging bitin na bitin<br />&gt; Gm D E7<br />di nila alam na sa dulo ng tagpo<br />&gt; D E7<br />di na patok ang linya ko<br />&gt; D E7<br />nag-iiba ang iyong asta<br />&gt; D A7<br />hanggang sa susunod na eksena<br /> <br /> <br />[Chorus]<br />&gt;G<br />Sana wag mong sisihin<br />&gt; Gm<br />kung di ko kayang pigilin<br />&gt;D<br />sabi mo na mahal mo &lsquo;ko<br />&gt; B7<br />ngunit di naman seryoso<br />&gt;Em<br />sana magkasingkulay<br />&gt; Gm D<br />ang drama at tunay na buhay ko<br />&gt;Bm Em<br />ang tanging pag-asa ko<br />&gt; A7<br />ay nasa tambalang ito<br /> <br /> <br />[Instrumental]<br /> <br />&gt;Bm - G<br />&gt;Bm - E - A<br /> <br /> <br />[Chorus]<br /> <br />&gt;G<br />Sana wag mong sisihin<br />&gt; Gm<br />kung di ko kayang pigilin<br />&gt;D<br />sabi mo na mahal mo &lsquo;ko<br />&gt; B7<br />ngunit di naman seryoso<br />&gt;G<br />sana magkasingkulay<br />&gt; Gm D<br />ang drama at tunay na buhay ko<br />&gt;Bm E7<br />ang tanging pag-asa ko<br />&gt; A7<br />ay nasa tambalang ito<br /> <br /> <br />[Outro]<br /> <br />&gt;G - D</p>', 'opm rock', 14, 'no', 'D', '', '2022-02-12 02:17:52', ''),
(702, 'Ayokong Tumanda', 39, '<p>[Intro]<br />&gt;B G#m C#m Em F#m<br /> <br />&gt; B G#m<br />e|---11-11--9--7-9--11-11--9-7-7--9--| e|---11-11--9--7-9--11-11--9-7-7--9--|<br />B|-----------------------------------| B|-----------------------------------|<br />G|-----------------------------------| G|-----------------------------------|<br />D|-----------------------------------| D|-----------------------------------|<br />A|-----------------------------------| A|-----------------------------------|<br />E|-----------------------------------| E|-----------------------------------|<br /> <br />&gt; C#m Em F#<br />e|---15-15--13--11-13--15-15--13-11-11--13--| e|---14-14--12--10-12--14-14--12-10-10--12--|<br />B|------------------------------------------| B|------------------------------------------|<br />G|------------------------------------------| G|------------------------------------------|<br />D|------------------------------------------| D|------------------------------------------|<br />A|------------------------------------------| A|------------------------------------------|<br />E|------------------------------------------| E|------------------------------------------|<br /> <br /> <br />[Verse]<br />&gt;B G#m<br />Naiinis ako pag naiisip ko<br />&gt;C#m Em<br />Lahat ng tao ay tumatanda<br />&gt;F#m<br />Aahhh &hellip;<br />&gt;B G#m<br />Naisip mo na ba pag tayo tumanda<br />&gt;C#m Em<br />Isa-isa na tayong mawawala<br />&gt;F#<br />Aahhh &hellip;<br /> <br /> <br />[Refrain]<br />&gt;G#m C#m<br />Naaalala mo pa ba ang panahon<br />&gt;F# B<br />Nung excited ka pa sa birthday mo taon-taon<br />&gt;G#m C#m<br />Ngayon puting buhok mo ay lumalabas<br />&gt;E F#<br />Kalendaryo ay gusto mong i-atras<br /> <br /> <br />[Chorus] (x2)<br />&gt;B<br />Ayokong tumanda<br />&gt;G#m<br />Ayokong tumanda<br />&gt;C#m<br />Ayokong tumanda<br />&gt;Em<br />Ayokong tumanda<br />&gt;F#<br />Kung hindi ka kasama<br /> <br /> <br />[Verse]<br />Natakot lang ako noong sinabi mo<br />Na ayaw mong ako ang mauna<br />Ahhh<br />Ang sabi ko sa sa yo mas lalong ayaw ko<br />Mawala ka at ako ang matira<br />Aahhh<br /> <br /> <br />[Refrain]<br />Naaalala mo pa ba ang panahon<br />Nung excited ka pa sa birthday mo taon-taon<br />Ngayon puting buhok mo ay lumalabas<br />Kalendaryo ay gusto mong i-atras<br /> <br /> <br />(Repeat Chorus) (x2)<br />&gt;B<br />Ayokong tumanda<br />&gt;G#m<br />Ayokong tumanda<br />&gt;C#m<br />Ayokong tumanda<br />&gt;Em<br />Ayokong tumanda<br />&gt;F#<br />Kung hindi ka kasama</p>\r\n<p>(Repeat) (x2)<br />&gt;B G#m C#m Em F# C#<br />Ha ha ha ha Ayokong tumanda</p>\r\n<p>Change key +2<br />(Repeat Chorus) (x2)</p>', 'opm rock', 14, 'no', 'B', '', '2022-02-12 02:17:52', ''),
