(729, 'Nakakapagtataka', 56, '<p>[VERSE 1]<br /> <br />&gt;E A E<br />Walang tigil ang gulo<br />&gt; G# C#m E (Dm7,)<br />sa aking pagiisip,<br />&gt; A B7 G#m<br />Mula ng tayo\'s nagpasyang mag<br />&gt; E<br /> hiwalay<br />&gt; A B7<br />Nagpaalam pagka\'t hindi tayo <br />&gt; G#m C#7<br /> bagay,<br />&gt; F#m B7<br />Nakapagtataka, (hoh hoh,)<br /> <br /> <br />[VERSE 2] (SAME CHORDS LANG)<br /> <br />Kung bakit ganito<br /> <br />Ang Aking Kapalaran<br /> <br />\'Di ba\'t ilang ulit ka nang nag<br /> <br /> paalam<br /> <br /> At bawat paalam ay puno ng<br /> iyakan?<br /> <br /> Nakapagtataka, Nakapagtataka<br /> <br /> <br />[Chorus]<br /> <br />&gt;G Bm<br />Hindi ka ba napapagod,<br />&gt; Em<br />O\' di kaya\'y nagsasawa,<br />&gt; C Am<br />Sa ating mga tampuhang<br />&gt; D<br />Walang hanggang katapusan?<br /> <br />&gt;G Bm<br />Napahid na\'ng mga luha,<br />&gt; Em<br />Damdamin at puso\'y tigang,<br />&gt; D C Am<br />Wala ng maibubuga,<br />&gt; D D<br />Wala na kong maramdaman. (hoh!)<br /> <br /> <br />[Verse 3]<br /> <br /> <br />Walang tigil ang ulan<br /> <br />At na-----san ka araw?<br /> <br /> Napa\'no na\'ng pag-ibig sa<br /> isa\'t isa?<br /> <br />Wala na bang nanatiling pag-asa?<br /> <br />Nakapagtataka, san na napunta?<br /> <br /> <br />[Chorus]<br /> <br />&gt;G Bm<br />Hindi ka ba napapagod,<br />&gt; Em<br />O\' di kaya\'y nagsasawa,<br />&gt; D C Am<br />Sa ating mga tampuhang<br />&gt; D<br />Walang hanggang katapusan?<br /> <br />&gt;G Bm<br />Napahid na\'ng mga luha,<br />&gt; Em<br />Damdamin at puso\'y tigang,<br />&gt; D C Am<br />Wala ng maibubuga,<br />&gt; D<br />Wala na kong maramdaman. (hoh!)</p>\r\n<p>&gt;G Bm Em - D - C - Am D<br />(Adlib)<br /> <br /> <br />[Chorus]<br /> <br />&gt;G Bm<br />Napahid na\'ng mga luha,<br />&gt; Em<br />Damdamin at puso\'y tigang,<br />&gt; C Am<br />Wala ng maibubuga,<br />&gt; D<br />Wala na kong maramdaman. (hoh!)<br /> <br /> <br />[Bridge]<br /> <br />&gt;C D Bm Em<br />Kung tunay tayong nagmamahalan<br /> <br />&gt;C D Bm Em<br />Ba\'t di tayo magkasunduan?<br /> <br />&gt; C D<br /> (Oh hoh-hoh)</p>', 'opm rock', 14, 'no', 'G', '', '2022-02-12 02:17:52', ''),
