(750, 'karma chameleon', 434, '<p>Original Key = Bb</p>\r\n<p>INTRO: <br />&gt;A E A</p>\r\n<p>&gt;A<br /> <br />&gt; A E A<br />Desert love in your eyes all the way<br />&gt; A E A<br />if I listen to your lie would you say<br />&gt; D E<br />I\'m a man whith out conviction<br />&gt; D E<br />I\'m a man who doesn\'t know<br />&gt; D E<br />How to sell a contracdiction<br />&gt; Bm<br />You come and go<br />&gt; F#m E<br />You come and go<br /> <br />&gt;A E F#m<br />Karma Karma Karma Karma Karma Chameleon<br />&gt; Bm<br />You come and go<br />&gt; A E<br />You come and go<br />&gt;A E F#m<br />Loving would be easy if your colours were like my dream<br />&gt; Bm<br />Red, gold and green<br />&gt; A E<br />Red, gold and green<br /> <br /> <br />&gt; A E A<br />Didn\'t hear your wicked words every day<br />&gt; A E A<br />And you used to be so sweet I heard you say<br />&gt; D E<br />That my love was an addiction<br />&gt; D E<br />When we cling our love is strong<br />&gt; D E<br />When you go you\'re gone forever<br />&gt; Bm<br />You string along<br />&gt; F#m E<br />You string along<br /> <br /> <br />&gt;A E F#m<br />Karma Karma Karma Karma Karma Chameleon<br />&gt; Bm<br />You come and go<br />&gt; A E<br />You come and go<br />&gt;A C#m F#m<br />Loving would be easy if your colours were like my dream<br />&gt; Bm<br />Red, gold and green<br />&gt; A E<br />Red, gold and green<br /> <br />&gt;D C#m<br />Every day is like a survival<br />&gt;Bm F#m<br />You\'re my lover not my rival<br />&gt;D C#m<br />Every day is like a survival<br />&gt;Bm F#m E<br />You\'re my lover not my rival<br /> <br /> <br />&gt;A E A X 2<br /> <br /> <br />&gt; D E<br />I\'m a man whith out conviction<br />&gt; D E<br />I\'m a man who doesn\'t know<br />&gt; D E<br />How to sell a contracdiction<br />&gt; Bm<br />You come and go<br />&gt; F#m E<br />You come and go<br /> <br />&gt;A E F#m<br />Karma Karma Karma Karma Karma Chameleon<br />&gt; Bm<br />You come and go<br />&gt; F#m E<br />You come and go<br />&gt;A E F#m<br />Loving would be easy if your colours were like my dream<br />&gt; Bm<br />Red, gold and green<br />&gt; A E<br />Red, gold and green</p>', 'upbeat', 3, 'no', 'Bb', '', '2022-02-12 02:17:52', ''),
(751, 'Eh, Eh (Nothing Else I Can Say)', 203, '<pre class=\"a-b-r-La\">&gt;E B F#m (4x)\r\n \r\n\r\n[Verse]\r\nF#m\r\nBoy we&rsquo;ve had a real good time and\r\n           			E   B\r\nI wish you the best on your way, eh\r\nF#m\r\nI didn&rsquo;t mean to hurt you\r\n                                E   B\r\nI never thought we&rsquo;d fall out of place, eh eh\r\n\r\n[Refrain] \r\nA				B\r\nI have something that I love long-long\r\nC#m					B\r\nBut my friends keep ah-telling me that something&rsquo;s wrong\r\nA\r\nThat I miss someone\r\n\r\n[Chorus] \r\n     B                             E\r\nand eh, there&rsquo;s nothing else I can say\r\nB     F#m                             E\r\n(Eh, Eh) There&rsquo;s nothing else I can say\r\n B    F#m                                   E\r\n(Eh, Eh) I wish you never looked at me that way\r\nB     F#m                            E\r\n(Eh, Eh) There&rsquo;s nothing else I can say\r\nB     F#m\r\n(Eh, Eh)\r\n\r\n\r\n[Verse]\r\nF#m\r\nNot that I don&rsquo;t care about you\r\n           			E   B\r\nJust that things got so complica- eh eh\r\nF#m\r\nI met somebody cute and funny\r\n           			E   B\r\nGot each other and that&rsquo;s funny, eh eh\r\n\r\n[Refrain] \r\nA				B\r\nI have something that I love long-long\r\nC#m					B\r\nBut my friends keep ah-telling me that something&rsquo;s wrong\r\nA\r\nThat I miss someone\r\n\r\n[Chorus]\r\n     B                             E\r\nand eh, there&rsquo;s nothing else I can say\r\nB     F#m                             E\r\n(Eh, Eh) There&rsquo;s nothing else I can say\r\n B    F#m                                   E\r\n(Eh, Eh) I wish you never looked at me that way\r\nB     F#m                            E\r\n(Eh, Eh) There&rsquo;s nothing else I can say\r\nB     F#m\r\n(Eh, Eh)\r\n \r\n[Refrain] \r\nA				B\r\nI have something that I love long-long\r\nC#m					B\r\nBut my friends keep ah-telling me that something&rsquo;s wrong\r\nA\r\nThat I miss someone\r\n\r\n\r\n[Chorus]\r\n     B                             E\r\nand eh, there&rsquo;s nothing else I can say\r\nB     F#m                             E\r\n(Eh, Eh) There&rsquo;s nothing else I can say\r\n B    F#m                                   E\r\n(Eh, Eh) I wish you never looked at me that way\r\nB     F#m                            E\r\n(Eh, Eh) There&rsquo;s nothing else I can say\r\nB     F#m\r\n(Eh, Eh)\r\n \r\nCherry-Cherry boom-boom\r\nAll I can say is Eh, Eh\r\n\r\n\r\n(Ending)</pre>', 'upbeat', 3, 'no', 'E', '', '2022-02-12 02:17:52', ''),
