(753, 'When I\'m gone', 436, '<p>[Intro]<br />&gt;D Dsus2 D G A<br />&gt;D Dsus2 D G A<br /> <br />[Verse 1]<br />&gt; D<br />When I\'m gone<br />&gt; B7<br />Will you take good care of everything?<br />&gt; Em<br />Will you keep wearing your wedding ring?<br />&gt; A<br />When I\'m gone<br />&gt; D<br />And when I\'m gone<br />&gt; B7<br />Will you take out all the photographs<br />&gt; Em <br />Maybe spend a moment in the past?<br />&gt; A<br />When I\'m gone<br /> <br />[Pre-chorus]<br />&gt; F#m Bm<br />Will you miss me in the night?<br />&gt; Em A G<br />Will your arms reach out to hold me tight<br />&gt; F#m Bm<br />And keep me in your dreams<br />&gt; G A<br />In your heart, in your life?<br /> <br />[Chorus]<br />&gt; D Bm<br />Sometimes I\'ll wanna run to you like lovers do<br />&gt; Em F# G<br />When love is new and just for a moment be close to you<br />&gt; A<br />Pretending I\'m still holding you.<br />&gt; D Bm<br />And even when I\'m far away the dreams will stay.<br />&gt; G F# G<br />And someday after we\'ve both chased our fantasies<br />&gt; A<br />Love will bring you back to me<br /> <br />[Bridge]<br />&gt;D Dsus2 D G A<br /> <br />[Verse 2]<br />&gt; D<br />When I\'m gone<br />&gt; B7<br />I\'ll be thinking about you constantly<br />&gt; Em A<br />\'Cause you\'re locked inside my memory from now on<br />&gt; D B7<br />And I know that we said we needed time apart<br />&gt; Em A<br />But your love keeps pulling at my heart, pulling strong<br /> <br />[Pre-chorus]<br />&gt; F#m Bm<br />Will you miss me in the night?<br />&gt; Em A G<br />Will your arms reach out to hold me tight<br />&gt; F#m Bm<br />And keep me in your dreams<br />&gt; G A<br />In your heart, in your life?<br /> <br />[Chorus]<br />&gt; D Bm<br />Sometimes I\'ll wanna run to you like lovers do<br />&gt; Em F# G<br />When love is new and just for a moment be close to you<br />&gt; A<br />Pretending I\'m still holding you.<br />&gt; D Bm<br />And even when I\'m far away the dreams will stay.<br />&gt; Em F# G<br />And someday after we\'ve both chased our fantasies<br />&gt; A<br />Love will bring you back to me<br /> <br />[Interlude]<br />&gt;D Dmaj7 D G A<br />&gt;D Dmaj7 D G A<br /> <br />[Chorus]<br />&gt; D Bm<br />Sometimes I\'ll wanna run to you like lovers do<br />&gt; Em F# G<br />When love is new and just for a moment be close to you<br />&gt; A<br />Pretending I\'m still holding you.<br />&gt; D Bm<br />And even when I\'m far away the dreams will stay.<br />&gt; Em F# G<br />And someday after we\'ve both chased our fantasies.<br />&gt; A<br />Love will bring you back to me.<br />&gt; D Bm<br />Sometimes I\'ll wanna run to you like lovers do<br />&gt; Em F# G<br />When love is new and just for a moment be close to you<br />&gt; A<br />Pretending I\'m still holding you...</p>', 'foreign classic', 13, 'no', 'D', '', '2022-02-12 02:17:52', ''),
(754, 'Until I found you', 437, '<p><br />Original key = Bb</p>\r\n<p>Intro :</p>\r\n<p>&gt;G Bm C Cmn</p>\r\n<p>[Verse 1]<br /> <br />G Bm C<br /> Georgia, wrap me up in all your...<br />G Bm C<br /> I want ya, in my arms<br /> G<br />Oh, let me hold ya<br />Bm C G<br /> I\'ll never let you go again,<br /> <br />like I did<br /> D<br />Oh, I used to say<br /> <br /> <br />[Chorus]<br /> <br /> C D<br />\"I would never fall in love again until<br />G Bm<br />I found her\"<br /> C D<br />I said, \"I would never fall unless it\'s<br />G G7<br />you I fall into\"<br /> C D<br />I was lost within the darkness, but<br /> G Bm<br />then I found her<br /> C Cm<br />I found you<br /> <br /> <br />[Verse 2]<br /> <br />G Bm C<br /> Georgia, pulled me in, I asked to...<br />G Bm C<br /> Love her, once again<br /> G<br />You fell, I caught ya<br />Bm C G<br /> I\'ll never let you go again,<br /> <br />like I did<br /> D<br />Oh, I used to say<br /> <br /> <br />[Chorus]<br /> <br /> C D<br />\"I would never fall in love again until<br />G Bm<br />I found her\"<br /> C D<br />I said, \"I would never fall unless it\'s<br />G G7<br />you I fall into\"<br /> C D<br />I was lost within the darkness, but<br /> G Bm<br />then I found her<br /> C Cm<br />I found you<br /> <br /> <br />[Instrumental]<br /> <br />G Bm C Cm<br /> <br /> <br />[Chorus]<br /> <br /> C D<br />\"I would never fall in love again until<br />G Bm<br />I found her\"<br /> C D<br />I said, \"I would never fall unless it\'s<br />G G7<br />you I fall into\"<br /> C D<br />I was lost within the darkness, but<br /> G <br />then I found her<br /> C Cm<br />I found you</p>', 'first set', 1, 'no', 'Bb', '', '2022-02-12 02:17:52', ''),
(755, 'Don\'t throw it all away', 86, '<p>Original key = F</p>\r\n<p>[Intro]<br />&gt;G Gmaj Am7 D7<br /> <br />&gt;G Gmaj Am7 D7<br /> <br />[Verse]<br />&gt;G Am7 Gmaj C<br /> Maybe I don\'t want to know the reason why<br />&gt;Am7<br /> But lately you don\'t talk to me<br />&gt; C D G Gmaj Am7 D7<br />And darling, I can\'t see me in your eyes<br /> <br />[Verse]<br />&gt;G Am7 Gmaj C<br /> I hold you near, but you\'re so far away<br />&gt; D<br />And it\'s losing you I can\'t believe<br />&gt; Bm C D7 G G7<br />To watch you leave and let this feeling die<br /> <br />[Bridge]<br />&gt;C C#dim Bm7<br /> You alone are the living thing that keeps me alive<br />&gt;Em Am7 D7 G<br /> And tomorrow, if I\'m here without your love<br />&gt; G7<br />You know I can\'t survive<br />&gt;C C#dim Bm7 C G/A<br /> Only my love can raise you high above it all<br /> <br />[Chorus]<br />&gt; Dmaj Dmaj7sus2<br />Don\'t throw it all away, our love, our love<br />&gt; Cmaj G<br />Don\'t throw it all away, our love<br />&gt; Dmaj Dmaj7sus2<br />Don\'t throw it all away, our love, our love<br />&gt; Cmaj G G7<br />Don\'t throw it all away, our love<br /> <br />[Break]<br />&gt;C Cm6 Bm7 E7 Am7 D7<br /> <br />&gt;G Gmaj Am7 D7<br /> <br />[Verse]<br />&gt;G Am7 Gmaj C<br /> We can take the darkness, make if full of light<br />&gt;Am7<br /> But let your love flow back to me<br />&gt; C D7 G G7<br />How can you leave and let this feeling die?<br /> <br />[Bridge]<br />&gt;C C#dim Bm7 Em<br /> This happy room would be a lonely place when you are gone<br />&gt;Am7 D7 G G7<br /> And I won\'t even have your shoulder for the crying on<br />&gt;C C#dim Bm7 C G/A<br /> No other woman\'s love could be as true, I\'m begging you<br /> <br />[Chorus]<br />&gt; Dmaj Dmaj7sus2<br />Don\'t throw it all away, our love, our love<br />&gt; Cmaj G<br />Don\'t throw it all away, our love<br />&gt; Dmaj Dmaj7sus2<br />Don\'t throw it all away, our love, our love<br />&gt; Cmaj G G7<br />Don\'t throw it all awa