(756, 'Bakit Hindi ka Crush Ng Crush mo', 323, '<p>Standard Tuning<br />&gt;E - xx24444<br />Use the Bar Chord on Ebm, C#m and C#m<br /> <br />[Intro] <br />&gt;B F# C#m F# (2x)<br /> <br />[Verse 1]<br />&gt;E Ebm<br />Bilib ako sa dami ng naniniwala sa love song<br />&gt;E Ebm<br />Mga nagbubulag-bulagan at nag-iilusyon<br />&gt;E Ebm<br />Mga pa-simple na nagbabakasakaling abangers<br />&gt; C#m F#m<br />Waiting forever, di maka-get over<br /> <br />&gt;E Ebm<br />Bumabalik pa rin ang ubod na kulit na damdamin<br />&gt;E Ebm<br />Mahirap daw na ma-in-love, baliw-baliwan, as in<br />&gt;E Ebm<br />Hindi makayang tanggapin ang final offer na friendship<br />&gt; C#m F#<br />Wagas sa yong isip, ang wish na relationship<br /> <br />[Pre-Chorus]<br />&gt; E Ebm E Em<br />well its complicated now, di niya lang masabi sa\'yo&hellip;<br />&gt; B E Ebm E Em F#<br />na wag ka nang umasa daw, pero yan lang ang totoo<br /> <br />[Chorus]<br />&gt;B F# G#m<br />OH NO, I SHOULD HAVE KNOWN, FRIENDZONE<br />&gt; F# C#m<br />BAT HINDI KA CRUSH NG CRUSH MO, DADADAN, DIDIDAW<br />&gt;E Em<br />WISH MO LANG NA MUTUAL ANG FEELINGS NIYO<br />&gt;B F# G#m<br />OH NO, THERE\'S MORE TO LIFE THAN LOVE<br />&gt; F# C#m<br />PAG HINDI KA CRUSH NG CRUSH MO, DADADAN, DIDIDAW<br />&gt;E Em<br />LIFE IS FUN BUT YOU JUST GOTTA FIND OUT HOW, OH...<br /> <br />&gt;B F# C#m F# <br />Doo-doodoodoo-doodoodoo-doodoodoo<br />&gt;B F# C#m F#<br />Doo-doodoodoo-doodoodoo-doodoodoo <br /> <br />Verse 2<br />&gt;E Ebm<br />Hanggang sa panaginip mo\'y bitin pa rin ang istorya<br />&gt;E Ebm<br />Mahal mo siya, ang twist pala, mahal niya daw ay iba, waaahhh...<br />&gt;E Ebm<br />Ang peg mo lang ay teleseryeng happy ending ang kwento<br />&gt; C#m F#<br />pero pap\'ano, why can\'t you just let go?<br /> <br />[Pre-Chorus]<br />&gt; E Ebm E Em<br />well its complicated now, di niya lang masabi sa\'yo&hellip;<br />&gt; B E Ebm E Em F#<br />na wag ka nang umasa daw, pero yan lang ang totoo<br /> <br />[Chorus]<