(757, 'To the bone', 438, '<p>Original key = Eb</p>\r\n<p>[Intro]<br />&gt;F G<br />&gt;F G<br /> <br /> <br />[Verse 1]<br />&gt; F<br />Have I ever told you<br />&gt; G<br />I want you to the bone<br />&gt; F<br />Have I ever called you<br />&gt; G<br />When you are all alone<br />&gt; F<br />And if I ever forget<br />&gt; G<br />To tell you how I feel<br />&gt; F<br />Listen to me now, babe<br />&gt; G<br />I want you to the bone<br /> <br /> <br />[Pre-Chorus]<br />&gt; F G<br />I want you to the bone, oh oh oh oh oh<br />&gt; F G<br />I want you to the bone, oh oh oh oh oh<br /> <br /> <br />[Verse 2]<br />&gt; F<br />Maybe if you can see<br />&gt; G<br />What I feel through my bone<br />&gt; F<br />Every corner in me<br />&gt; G<br />There\'s your presence that grown<br />&gt; F<br />Maybe I nurture it more<br />&gt; G<br />By saying how it feel<br />&gt; F<br />But I did mean it before<br />&gt; G<br />I want you to the bone<br /> <br />I want you to<br /> <br /> <br />[Chorus]<br />&gt; C G<br />Take me home, I\'m fallin\'<br />&gt; Am Em<br />Love me long, I\'m rollin\'<br />&gt; F Em<br />Losing control, body and soul<br />&gt; Dm G<br />Mind too for sure, I\'m already yours<br />&gt; C G<br />Walk you down, I\'m all in<br />&gt; Am Em<br />Hold you tight, you call and<br />&gt; F Em<br />I\'ll take control, body and soul<br />&gt; Dm G<br />Mind too for sure, I\'m already yours<br />&gt; Am Bb<br />Would that be alright?<br />&gt; Am Bb G<br />Hey, would that be alright?<br />&gt; F G<br />I want you to the bone ooh..<br />&gt; F G<br />So bad I can\'t breathe ooh..<br />&gt; F<br />I want you to the bone<br /> <br /> <br />&gt;F G<br />&gt;F G<br /> <br /> <br />[Bridge]<br />&gt; F<br />Of all the ones that begged to stay<br />&gt; G<br />I\'m still longing for you<br />&gt; F<br />Of all the ones that cried their way<br />&gt; G<br />I\'m still waiting on you<br />&gt; F<br />Maybe we seek for something that<br />&gt; G<br />We couldn\'t ever have<br /