(758, 'So perfect', 20, '<p>Intro: <br />&gt;Bm - A - Bm - A - G<br /> <br />&gt;D9 Em<br />Jus walkin\' around the valley<br />&gt; D/F#m G<br />To seel all the beauty around me<br />&gt; D/F#m Em<br />I\'ve been to many places <br />&gt; D/F#m G<br />To find me some solace</p>\r\n<p>[lick]<br /> <br />&gt; D9 Em<br />Then I took one glance<br />&gt; D/F#m G<br />It stopped me and caught my attention<br />&gt; D/F#m Em<br />When you look at me<br />&gt; D/F#m G<br />I felt my knees weaken<br /> <br />Refrain:<br />&gt; D Em<br />How could I miss those eyes<br />&gt; D/F#m G<br />That melt my heart away<br />&gt; D/F#m Em<br />You got a smile that brightens<br />&gt; D/F#m D<br />Till the end of the day<br /> <br />Chorus:<br />&gt; D Em<br />With a silence you get closer<br />&gt; D/F#m G<br />I catch my breath, I catch my breath<br /> <br />&gt; D Em<br />You\'re an angel in disguise<br />&gt; D/F#m G<br />So perfect, so perfect love<br />&gt; G Bm-A-Bm-A-G<br />I wanted this on my life<br /> <br />&gt;D9 Em<br />I wonder what could bring us closer<br />&gt; D/F#m G<br />I don\'t want this dream to be over<br />&gt; D/F#m Em<br />Another day goes by<br />&gt; D/F#m G<br />To search for that beautiful smile</p>\r\n<p>[lick]<br /> <br />(repeat 2nd stanza)<br />(repeat refain)<br />(repeat chorus)<br /> <br />Adlib: <br />&gt;Bm - A - Bm - A - G</p>\r\n<p>(repeat refain)<br />(repeat chorus)</p>', 'fast song', 22, 'no', 'D', '', '2022-02-12 02:17:52', ''),
