(764, 'Two less lonely people in the world', 363, '<p>[Intro]<br />&gt;Am Bm C D Em<br /> <br />[Verse 1]<br />&gt; Em D C<br />I was down, my dreams were wearing thin<br />&gt; Am D Bm<br />When you\'re lost, where do you begin?<br />&gt; C D Bm Em<br />My heart always seemed to drift from day to day<br />&gt; Am D<br />Looking for the love that never came my way<br /> <br />&gt; Em D C<br />Then you smiled and I reached out to you<br />&gt; Am D Bm<br />I could tell you were lonely too<br />&gt; C D Bm Em<br />One look and then it all began for you and me<br />&gt; Am D<br />The moment that we touched I knew that there would be<br /> <br />[Chorus]<br />&gt;G<br />Two less lonely people in the world<br />&gt;Bm<br />And it\'s gonna be fine<br />&gt;C<br />Out of all the people in the world<br />&gt;Cm D<br />I just can\'t believe you\'re mine<br />&gt;G<br />In my life where everything was wrong<br />&gt;Bm Em<br />Something finally went right<br />&gt; Am<br />Now there\'s two less lonely people<br />&gt; D<br />In the world tonight<br /> <br />[Interlude]<br />&gt;G Bm C D<br /> <br />[Verse 2]<br />&gt; Em D C<br />Just to think what I might have missed<br />&gt; Am D Bm<br />Looking back how did I exist<br />&gt; C D Bm Em<br />I dreamed, still I never thought I\'d come this far<br />&gt; Am D<br />But miracles come true, I know \'cause here we are<br /> <br />[Chorus 2]<br />&gt;G<br />Two less lonely people in the world<br />&gt;Bm<br />And it\'s gonna be fine<br />&gt;C<br />Out of all the people in the world<br />&gt;Cm D<br />I just can\'t believe you\'re mine<br />&gt;G<br />In my life where everything was wrong<br />&gt;Bm Em<br />Something finally went right<br />&gt; Am<br />Now there\'s two less lonely people<br />&gt; D<br />In the world tonight<br /> <br />[Interlude]<br />&gt;G Bm C D<br /> <br />[Bridge]<br />&gt; Em D<br />Tonight I fell in love with you<br />&gt; C Bm<br />And all the things I never knew<br />&gt;Am Bm<br />Seemed to come to me