(779, 'Young dumb and broke', 448, '<p>Original Key = F#</p>\r\n<p>[Intro]<br />F<br /> <br />[Verse 1]<br />F<br /> So you\'re still thinking of me<br />F<br /> Just like I know you should<br />Dm C<br /> I can not give you everything, you know I wish I could<br />F<br /> I\'m so high at the moment<br />F<br /> I\'m so caught up in this<br />Dm<br />Yeah, we\'re just young, dumb and broke<br />C<br /> But we still got love to give<br /> <br />[Chorus]<br /> F<br />While we\'re young dumb, young-young dumb and broke<br />F<br />Young dumb, Young-young dumb and broke<br />Dm<br />Young dumb, Young-young dumb and broke<br />C<br /> Young dumb broke high school kids<br />F<br />Yadadadadadadada<br />F<br />Yadadadadadada<br />Dm<br />Yadadadadadadada<br />C<br /> Young dumb broke high school kids<br /> <br />[Verse 2]<br />F<br /> We have so much in common<br />F<br /> We argue all the time<br />Dm<br /> You always say I\'m wrong<br />C<br /> I\'m pretty sure I\'m right<br />F<br /> What\'s fun about commitment?<br />F<br /> When we have our life to live<br />Dm<br /> Yeah, we\'re just young dumb and broke<br />C<br /> But we still got love to give<br /> <br />[Chorus]<br /> F<br />While we\'re young dumb, young-young dumb and broke<br />F<br />Young dumb, Young-young dumb and broke<br />Dm<br />Young dumb, Young-young dumb and broke<br />C<br /> Young dumb broke high school kids<br />F<br />Yadadadadadadada<br />F<br />Yadadadadadada<br />Dm<br />Yadadadadadadada<br />C<br /> Young dumb broke high school kids<br /> <br />[Bridge]<br />F<br />Jump and we think,<br /> <br />Leave it all in the game of love, love<br />Dm<br />Run into sin, <br /> C<br />Do it all in the name of fun, fun<br /> <br />[Verse 3]<br />F<br /> I\'m so high at the moment<br />F<br /> I\'m so caught up in this<br />Dm<br /> Yeah, we\'re just young, dumb and broke<br />N.C.<br /> But we still got love to give<br /> <br />[Chorus]<br /> F<br />While we\'re young dumb, young-young dumb and broke<br />F<br />Young dumb, Young-young dumb and broke<br />Dm<br />Young dumb, Young-young dumb and broke<br />C<br /> Young dumb broke high school kids<br />F<br />Yadadadadadadada<br />F<br />Yadadadadadada<br />Dm<br />Yadadadadadadada<br />C<br /> Young dumb broke high school kids<br />F<br />Yadadadadadadada<br />F<br />Yadadadadadada<br />Dm<br />Yadadadadadadada<br />C<br /> Young dumb broke high school kids</p>', 'first set', 4, 'no', 'F#', '', '2022-02-12 02:17:52', ''),
