(785, 'Gikumotkumot', 452, '<p>Gikumot-kumot<br />&gt;A<br /> <br />1.<br />&gt; A E<br />gpanumpa ko na, nga kitang duha<br />&gt; D E<br />magtiunay sa ato nga gugma.<br />&gt; A E<br />abi mog kita, magkadayon na<br />&gt; D E<br />kay sa gugma nanumpa ta.<br /> <br />Ref.<br />&gt; F#m Bm<br />kalit gibyaan ikaaw nga naghilak<br />&gt; D E<br />mao nang dagway mo sa samin daw mabuak.<br /> <br />Cho.<br />&gt; A<br />kay gikumot-kumot(gikumot-kumot)<br />&gt; E<br />sa dakong kamot(sa dakong kamot)<br />&gt; D E<br />ang dughan mong pagkadako, dako sa gugma<br />&gt; A<br />kay gikumot-kumot(GIKUMOT-KUMOT)<br />&gt; E<br />sa dakong kamot(sa dakong kamot)<br />&gt; D E<br />ang dughan mong pagkadako, dako sa gugma.</p>\r\n<p>[repeat verse 1] <br />[Ref. and Cho.]<br /> <br />&gt; A<br />Kay gikumot-kumoT (gikumot-kumot)<br />&gt; E<br />gikumot-kumot, gikumot-kumot<br />&gt; D<br />gikumot-kumot, gikumot-kumot<br />&gt; E<br />gikumot-kumoooooot..<br /> <br />[repeat Ref. and Cho]</p>', 'bisrock', 6, 'no', 'A', '', '2022-02-12 02:17:52', ''),
(786, 'We and us', 384, '<p><br />Original key = G#</p>\r\n<p>[Intro]<br />&gt;F C G<br /> <br />[Verse 1]<br />&gt; F<br />Rainbow notes up on the wall<br />&gt; C<br />Dancing children under rainfall<br />&gt; F (pause)<br />Perfect sunset set to ten<br />&gt; C<br />Then we begin again<br />&gt; F<br />There\'s a ribbon in the sky<br />&gt; C<br />Painting rivers in the moonlight<br />&gt; F<br />Moving pictures say the word<br />&gt; C<br />Of a story that begins.<br /> <br />[Pre-Chorus]<br />&gt; F C<br />I\'ll hold your hand and wipe your tears<br />&gt; F G<br />We\'ll laugh until we run out of years<br /> <br />[Chorus]<br />&gt; F<br />Cause no matter if our blue skies turn to gray<br />&gt; C<br />There\'s a ray of sun that\'s bound to light our way<br />&gt; F<br />And although the roads are rough<br />&gt; C<br />I\'ll get through it just because<br />&gt; F<br />I have my You<br />&gt; C<br />You have Me<br />&gt; F<br />No matter what may come<br />&gt; C G C <br />We\'ll have our We and Us<br /> <br />[Verse 2]<br />&gt; F<br />Through tired eyes see your soul<br />&gt; C<br />Promise you\'ll never be alone<br />&gt; F<br />When you need life i\'ll give you rest<br />&gt; C<br />When you ask for good i\'ll give you best<br /> <br />[Pre-Chorus 2]<br />&gt; F C<br />And once again i was caught off guard<br />&gt; F G<br />The best surprise is when you gave your heart<br /> <br />[Chorus]<br />&gt; F<br />Cause no matter if our blue skies turn to gray<br />&gt; C<br />There\'s a ray of sun that\'s bound to light our way<br />&gt; F<br />And although the roads are rough<br />&gt; C<br />I\'ll get through it just because<br />&gt; F<br />I have my You<br />&gt; C<br />You have Me<br />&gt; F<br />No matter what may come<br />&gt; C G F<br />We\'ll have our We and Us<br />&gt; C<br />We and Us<br />&gt; F<br />We and Us<br />&gt; C<br />We and Us<br /> <br />[Bridge]<br />&gt; F<br />And as you gaze at the stars tonight<br />&gt;C F<br />I will gaze at a star move beautiful and bright<br />&gt; F C<br />And I , I can do this forever and<br />&gt;F<br />It could be You and Me<br />We and Us oohh<br />&gt;C<br />You and Me<br />We and Us oohh<br />&gt;F<br />You and Me<br />We and Us<br />&gt;C<br />Forever</p>\r\n<p>[Stop]<br />&gt;F<br />You and Me<br />We and Us oohh<br />&gt;C<br />You and Me<br />We and Us oohh<br />&gt;F<br />You and Me<br />We and Us<br />&gt;C<br />Forever<br /> <br />[Chorus]<br />&gt; F C<br />Cause no matter if our blue skies turn to gray<br />&gt; F <br />There\'s a ray of sun that\'s bound to light our way<br />&gt; F/C<br />And although the roads are rough<br />&gt; C<br />I\'ll get through it just because<br />&gt; F<br />I have my You<br />&gt; C<br />You have Me<br />&gt; F<br />No matter what may come<br />&gt; C G C C<br />We\'ll have our We and Us</p>', 'first set', 1, 'no', 'G', '', '2022-02-12 02:17:52', ''),
(787, 'Say Something', 453, '<p>[Intro]<br />Am F C G</p>\r\n<p>[Chorus]<br /> <br />Am F C Gsus4<br /> Say something, I\'m giving up on you.<br />Am F C Gsus4<br /> I\'ll be the one, if you want me to.<br />Am F C Gsus4<br /> Anywhere, I would\'ve followed you.<br />Am F C Gsus4<br /> Say something, I\'m giving up on you.<br /> <br /> <br />[Verse]<br /> <br /> C Em<br />And I am feeling so small.<br /> F<br />It was over my head<br /> C Gsus4<br />I know nothing at all.<br /> <br /> C Em<br />And I will stumble and fall.<br /> F<br />I\'m still learning to love<br /> C Gsus4<br />Just starting to crawl.<br /> <br /> <br />[Chorus]<br /> <br />Am F C Gsus4<br /> Say something, I\'m giving up on you.<br />Am F C Gsus4<br /> I\'m sorry that I couldn\'t get to you.<br />Am F C Gsus4<br /> Anywhere, I would\'ve followed you.<br />Am F C Gsus4<br /> Say something, I\'m giving up on you.<br /> <br /> <br />[Verse]<br /> <br /> C Em<br />And I will swallow my pride.<br /> F<br />You\'re the one that I love<br /> C Gsus4<br />And I\'m saying goodbye.<br /> <br /> <br />[Chorus]<br /> <br />Am F C Gsus4<br /> Say something, I\'m giving up on you.<br />Am F C Gsus4<br /> And I\'m sorry that I couldn\'t get to you.<br />Am F C Gsus4<br /> And anywhere, I would\'ve followed you-ou, ohhhh-ohhhh<br />Am F C Gsus4<br /> Say something, I\'m giving up on you.<br /> <br />[Outro]<br />Am F C Gsus4<br /> Say something, I\'m giving up on you.<br />Am F C<br /> Say something</p>', 'first set', 1, 'no', 'Bm', '', '2022-02-12 02:17:52', ''),
