(789, 'All  by myself', 454, '<p>[Intro]<br /> <br />&gt;F (x8)<br />[VERSE I] <br />&gt;F<br />When I was young<br />&gt; Bbm/F F Am7-5/Eb<br />I never needed anyone<br />&gt; Dsus4 D Gm<br />And makin\' love was just for fun<br />&gt;Bbm6<br /> Those days are ]<br /> <br />&gt; F/A Gm7-5 C/E<br />gone</p>\r\n<p>[VERSE II] <br />&gt;F<br />Livin\' alone<br />&gt; Bbm/F F Am7-5/Eb<br />I think of all the friends I\'ve known<br />&gt; Dsus4 D Gm<br />But when I dial the telephone<br />&gt;Bbm6<br /> Nobody\'s <br />&gt;F/A Adim D D7 G Bbm Bbm C/E<br />home</p>\r\n<p>[Chorus]<br />&gt;F Am7<br /> All by myself<br />&gt; Am7-5/Eb<br />Dont wanna be<br />&gt; D7 Gm Gm7-5/Db C7<br />All by myself anymore<br />&gt;F Am7<br /> All by myself<br />&gt; Am7-5/Eb<br />Dont wanna live<br />&gt; D7 Gm Gm7-5/Db C7<br />All by myself anymore<br /> <br />[VERSE III] <br />&gt;F<br />Hard to be sure<br />&gt; Bbm/F F Am7-5/Eb<br />Some times I feel so insecure<br />&gt; Dsus4 D Gm<br />And love so distant and obscure<br />&gt;Bbm6<br /> Remains the cure<br />&gt;F/A Gm7-5 C/E<br />cure</p>\r\n<p>&nbsp;</p>\r\n<p>&gt;F<br />When I was young<br />&gt; Bbm/F F Am7-5/Eb<br />I never needed anyone<br />&gt; Dsus4 D Gm<br />And makin\' love was just for fun<br />&gt;Bbm6<br />Those days are<br /> <br />&gt;F/A Adim D D7 G Bbm Bbm C/E<br />gone</p>\r\n<p><br />[Chorus] <br />&gt;F Am7<br /> All by myself<br />&gt; Am7-5/Eb<br />Dont wanna be<br />&gt; D7 Gm Gm7-5/Db C7<br />All by myself anymore<br />&gt;F Am7<br /> All by myself<br />&gt; Am7-5/Eb<br />Dont wanna live<br />&gt; D7 Gm Gm7-5/Db C7<br />All by myself anymore<br /> <br /> <br />[In Extended Version]<br /> <br /> <br />[Piano Solo]<br /> <br />F<br />When I was young<br /> Bbm/F F Am7-5/Eb<br />I never needed anyone<br /> Dsus4 D Gm<br />And makin\' love was just for fun<br />Bbm6<br /> Those days are<br />F/A F/A Gm7-5 C/E<br />(arpeggiate the chord and hold)<br />gone<br /> <br />F Am7<br /> All by myself<br /> Am7-5/Eb<br />Dont wanna be<br /> D7 Gm Gm7-5/Db C7<br />All by myself anymore<br />F Am7<br /> All by myself<br /> Am7-5/Eb<br />Dont wanna live<br /> D7 Gm Gm7-5/Db C7<br />All by myself anymore</p>', 'foreign classic', 8, 'no', 'F', '', '2022-02-12 02:17:52', ''),
(790, 'Best day of my life', 455, '<p>&gt; D<br />I had a dream so big and loud<br /> <br />I jumped so high I touched the clouds<br />&gt; G<br />Wo-o-o-o-o-oh<br />&gt; G<br />Wo-o-o-o-o-oh<br />&gt; D<br />I stretched my hands out to the sky<br /> <br />We danced with monsters through the night<br />&gt; G<br />Wo-o-o-o-o-oh<br />&gt; G<br />Wo-o-o-o-o-oh<br /> <br /> <br />[Pre-Chorus]<br /> <br />&gt; Bm<br />I\'m never gonna look back<br />&gt; D<br />Woah, never gonna give it up<br />&gt; G<br />No, please don\'t wake me now<br /> <br /> <br />[Chorus]<br /> <br />&gt;D<br />Oo-o-o-o-oo<br />&gt; G<br />This is gonna be the best day of my li-ife<br /> <br />My li-i-i-i-i-ife<br />&gt;D<br />Oo-o-o-o-oo<br />&gt; G<br />This is gonna be the best day of my li-ife<br />&gt; D G<br />My li-i-i-i-i-ife</p>\r\n<p>[Lick]<br /> <br /> <br />[Verse]<br /> <br />&gt; D<br />I howled at the moon with friends<br /> <br />And then the sun came crashing in<br />&gt; G<br />Wo-o-o-o-o-oh<br />&gt; G<br />Wo-o-o-o-o-oh<br />&gt; D<br />But all the possibilities<br /> <br />No limits, just epiphanies<br />&gt; G<br />Wo-o-o-o-o-oh<br />&gt; G<br />Wo-o-o-o-o-oh<br /> <br /> <br />[Pre-Chorus]<br /> <br />&gt; Bm<br />I\'m never gonna look back<br />&gt; D<br />Woah, never gonna give it up<br />&gt; G<br />No, just don\'t wake me now<br /> <br /> <br />[Chorus]<br /> <br />&gt;D<br />Oo-o-o-o-oo<br />&gt; G<br />This is gonna be the best day of my li-ife<br /> <br />My li-i-i-i-i-ife<br />&gt;D<br />Oo-o-o-o-oo<br />&gt; G<br />This is gonna be the best day of my li-ife<br />&gt; D G<br />My li-i-i-i-i-ife</p>\r\n<p>[Lick]<br /> <br />[Bridge]<br /> <br />&gt;D<br />I hear it calling outside my window<br />&gt;D<br />I feel it in my soul (soul)<br />&gt; D<br />The stars were burning so bright<br />&gt; D<br />The sun was out \'til midnight<br />&gt;D<br />I say we lose control (control)<br /> <br />[Intro Lick]<br /> <br />[Chorus]<br /> <br />&gt;D<br />Oo-o-o-o-oo<br />&gt;D G<br /> This is gonna be the best day of my li-ife<br /> <br />My li-i-i-i-i-ife<br />&gt;D<br />Oo-o-o-o-o<br />&gt; G<br />This is gonna be the best day of my li-ife<br /> <br />My li-i-i-i-i-ife<br />&gt;D<br /> This is gonna be, this is gonna be, this is gonna be<br />&gt; G<br />The best day of my life<br /> <br />Everything is looking up, everybody up now<br />&gt;D G<br /> This is gonna be the best day of my li-ife<br />&gt; D<br />My li-i-i-i-i-ife</p>', 'fast song', 23, 'no', 'D', '', '2022-02-12 02:17:52', ''),
