(792, 'Suroy suroy', 411, '<p>SUROYSUROY<br /> <br />Missing filemon<br /> <br />Intro:<br />&gt;D7sus<br /> <br /> <br />[Chorus]<br />&gt;G D C<br />Ipaagi lang og lakbay-lakbay patid labay-labay <br />&gt;D G<br />Sa lata nga gamay <br />&gt;D C D<br />Ang mga kahilayan nga milumay kang dodong ug <br />&gt;Em<br />inday <br />&gt;D Em D<br />Luyo unya sa \'tong katawa tan-awa ta og may <br />&gt;C<br />kalipay ba<br /> <br /> <br />[Verse]<br /> <br />&gt;G Bm<br />sayo sa buntag sugod na paglakaw <br />&gt;Am D<br />kay ang adlaw sa imong panit di pa sakit<br />&gt;G Bm<br />ang kadalanan sa atong dakbayan <br />&gt;Am D<br />gubot pa\'s lukot basin ka\'g maugmaan<br />&gt;C Cm G<br />ayaw baya og pagmahay ayaw baya\'g ingna nga <br />&gt;Em<br />wa ka kaangay <br />&gt;Am Cm Bm D<br />kay ang makita mo migo kaugalingon mo <br /> <br />(use same chord patter for the rest of the song)<br /> <br />[Verse]<br /> <br />dalan colon gamay lang gud gihapon<br />ang gazining sunog balay na ron sa buyog<br />may mga batang naghingos og putos<br />abi nimo\'g pansit apan diay papilit<br />liko\'s tuo padung jones avenue<br />you gotta say it cool mora pu\'g amerkano<br />but your American express gikawat sa pulis<br /> <br />[Chorus]<br />&gt;G D C<br />Ipaagi lang og lakbay-lakbay patid labay-labay <br />&gt;D G<br />Sa lata nga gamay <br />&gt;D C D<br />Ang mga kahilayan nga milumay kang dodong ug <br />&gt;Em<br />inday <br />&gt;D Em D<br />Luyo unya sa \'tong katawa tan-awa ta og may <br />&gt;C<br />kalipay ba<br /> <br />[Verse]<br /> <br />ay\'g tugot nga sa fuente ka magutman<br />kay usahay sa larsian magsakit ang tiyan<br />si aida, lorna, o di ba si fe<br />ay\'g pada sa tigaw maanan ka nga bugaw<br />liko\'s tuo padung jones avenue<br />you gotta say it cool mura pu\'g amerkano<br />the girls will need the money soon<br />kay finals na puhon<br /> <br />[Chorus]<br />&gt;G D C<br />Ipaagi lang og lakbay-lakbay patid labay-labay <br />&gt;D G<br />Sa lata nga gamay <br />&gt;D C D<br />Ang mga kahilayan nga milumay kang dodong ug <br />&gt;Em<br />inday <br />&gt;D Em D<br />Luyo unya sa \'tong katawa tan-awa ta og may <br />&gt;C<br />kalipay ba</p>\r\n<p>[Adlib]<br />&gt;G Bm Am D G Bm Am D<br />&gt;Em D Em D C<br />padapapapa. . . .<br /> <br />[Verse]<br /> <br />duha, tulo, upat ang malls sa cebu<br />may ayala shoemart may carbon ug happy mart<br />33, 32, 51 ug 82mga cell phone gilabni sa tindero\'g<br />mani liko\'s tuo padung jones avenue<br />you gotta say it cool mura pu\'g amerkano<br />the city smells of guns and goons<br />no more candies and balloons<br /> <br />[Chorus]<br />&gt;G D C<br />Ipaagi lang og lakbay-lakbay patid labay-labay <br />&gt;D G<br />Sa lata nga gamay <br />&gt;D C D<br />Ang mga kahilayan nga milumay kang dodong ug <br />&gt;Em<br />inday <br />&gt;D Em D<br />Luyo unya sa \'tong katawa tan-awa ta og may <br />&gt;C<br />kalipay ba</p>\r\n<p>[Repeat Chorus]</p>', 'bisrock', 11, 'no', 'G', '', '2022-02-12 02:17:52', '');
