(793, 'wake me up before you go go', 456, '<p>[Intro]<br /> <br />&gt;C <br />(palm mute)<br />Jitterbug [4X]<br /> <br /> <br />[Verse 1]<br /> <br />&gt; C<br />You put the boom-boom into my heart<br />&gt; Dm C<br />You send my soul sky high when your lovin\' starts<br />&gt;C<br />Jitterbug into my brain<br />&gt; Dm C<br />Goes a bang-bang-bang \'til my feet do the same<br /> <br />&gt; Dm<br />But something\'s bugging you<br />&gt;Em<br />Something ain\'t right<br />&gt; F Em<br />My best friend told me what you did last night<br />&gt;Dm Em<br />Left me sleepin\' in my bed<br />&gt;F G<br />I was dreaming, but I should have been with you instead.<br /> <br /> <br />[Chorus]<br /> <br />N.C. <br />&gt; C<br />Wake me up before you go-go <br />&gt; Dm C<br />Don\'t leave me hanging on like a yo-yo<br />&gt; C<br />Wake me up before you go-go<br />&gt; Dm C<br />I don\'t want to miss it when you hit that high<br />&gt; C<br />Wake me up before you go-go<br />&gt; Dm C<br />\'Cause I\'m not plannin\' on going solo<br />&gt; C<br />Wake me up before you go-go<br />&gt;Em Dm C9 F/C C7<br />Take me dancing tonight<br />&gt; C9 F/C C7<br />I wanna hit that high (yeah, yeah)<br /> <br /> <br />[Verse 2]<br /> <br />&gt; C<br />You take the grey skies out of my way<br />&gt; Dm C<br />You make the sun shine brighter than Doris Day<br />&gt; C<br />Turned a bright spark into a flame<br />&gt; Dm C<br />My beats per minute never been the same<br /> <br />&gt; Dm Em<br />\'Cause you\'re my lady, I\'m your fool<br />&gt; F Em<br />It makes me crazy when you act so cruel<br />&gt;Dm Em<br />Come on, baby, let\'s not fight<br />&gt;F G<br />We\'ll go dancing, everything will be all right<br /> <br /> <br />[Chorus]<br /> <br />N.C.<br />&gt; C<br />Wake me up before you go-go <br />&gt; Dm C<br />Don\'t leave me hanging on like a yo-yo<br />&gt; C<br />Wake me up before you go-go<br />&gt; Dm C<br />I don\'t want to miss it when you hit that high<br />&gt; C<br />Wake me up 