(794, 'Just the way you are(Bj)', 192, '<p>[Intro]<br /> <br />&gt;D Gm6/D G/D D<br />&gt;D Gm6/D G/D D<br /> <br /> <br />[Verse 1]<br /> <br />&gt;D Bm6 Gmaj7 Bm D7 Gmaj7 Gm7 D/F#<br />Don\'t go changin\' to try please me you never let me down before<br />&gt;Am7 D7 Gmaj7 Gm7 D/F# Bm7<br />Mmmm Don\'t imagine you\'re too familiar<br />&gt;E9sus4 E7 G/A<br />And I don\'t see you anymore<br /> <br /> <br />[Refrain 1]<br /> <br />&gt;D Bm6 Gmaj7 Bm D9<br /> I would not leave you in times of trouble<br />&gt;Gmaj7 Gm7 D/F#<br /> we never could have come this far<br />&gt;Am7 D7 Gmaj7 Gm D/F# Bm7<br />Mmmm I took the good times I\'ll take the bad times<br />&gt;Em7 G/A Gm6/D G/D D Gm6/D G/D D<br /> I\'ll take you just the way you are<br /> <br /> <br />[Verse 2]<br /> <br />&gt;D Bm6 Gmaj7 Bm D9<br /> Don\'t go trying some new fashion<br />&gt;Gmaj7 Gm D/F#<br /> Don\'t change the colour of your hair<br />&gt;Am7 D7 Gmaj7 Gm D/F# Bm7<br /> Mmmm You always have my unspoken passion<br />&gt;E9sus4 E9 G/A<br /> Although I might not seem to care<br /> <br /> <br />[Refrain 2]<br /> <br />&gt; D Bm6 Gmaj7 Bm D9 Gmaj7 Gm D/F#<br />I don\'t want clever conversation I never want to work that hard<br />&gt;Am7 D7 Gmaj7 Gm D/F# Bm7<br />Mmmm I just want someone that I can talk to<br />&gt;Em7 G/A Gm6/D G/D D Gm6/D DM7 D7<br /> I\'ll want you just the way you are<br /> <br /> <br />[Bridge]<br /> <br />&gt;Gmaj7 A6 F#m7 B7<br /> I need to know that you will always be<br />&gt;Em7 A7sus D D/C<br /> the same old someone that I knew<br />&gt;Bb C Am7 D9<br /> What will it take till you believe in me<br />&gt;Gm C/G G/A<br /> The way that I believe in you<br /> <br /> <br />[Refrain 3]<br /> <br />&gt; D Bm6 Gmaj7 Bm D9<br /> I said I love you &amp; that\'s forever<br />&gt;Gmaj7 Gm D/F#<br /> and this I promise from the heart<br />&gt;Am7 D7 Gmaj7 Gm D/F# Bm7<br />Mmmm I couldn\'t love you any better<br />&gt;Em7 G/A Gm6/D G/D D Gm6/D G/D D<br /> I\'ll love you just the way you are