(795, 'Inspector Mills', 420, '<p>[Intro]<br />&gt;C#m C#m<br /> <br />[Verse I:]<br />&gt; C#m A F#m<br />Inspector Mills, Id like to tell you bout the girl I saw<br />&gt; G#7 G#m C#m G#m F#m E<br /> At the party just the other night in Beverly Hills<br />&gt; C#m A F#m<br />Inspector Mills, I hope you find her and it dont take long<br />&gt; G#7 G#m <br /> Watch my feelings for her growin strong in a war of wills<br />&gt;A F#m C#m...<br /> Inspector Mills<br /> <br />[Chorus I:]<br />&gt;C#m F#m<br /> I cant attempt to point you in her direction<br />&gt;B G#m C#m<br /> I didnt see her walkin out of the door<br />&gt;A E B<br /> If Id taken my time, shed be standin here still<br />&gt; G#7 C#m A - B<br /> Inspector Mills</p>\r\n<p><br /> <br />[Verse II:]<br />&gt;C#m A F#m<br />Ive recalled, once in my life I felt this way before<br />&gt; G#7 G#m C#m G#m F#m E<br />But I let her go towards the door, and walked away<br />&gt; C#m A F#m<br />Inspector Mills, I cant attempt to show the hurt in me<br />&gt; G#7 G#m A<br /> Just how much I need her company, search the valleys and the hills<br />&gt; F#m C#m<br /> Youve got to find her Mr. Mills<br /> <br />[Chorus II:]<br />&gt;C#m F#m<br /> I cant attempt to point you in her direction<br />&gt;B G#m C#m<br /> I was blinded by the look in her eyes<br />&gt;A E B<br /> If Id taken my time, shed be sittin here still<br />&gt; G#7 C#m A - B<br /> Inspector Mills<br /> <br />[Interlude]<br />&gt;E Ebm Dm A<br />Hooh... Someday soon, I might be in love with her...<br /> <br />[Instrumental:]<br />&gt;Am D G Bbm Eb G#...</p>\r\n<p>&gt;C#m<br /> <br />[Verse III:]<br /> <br />&gt; C#m A F#m<br />Inspector Mills, I think youve taken quite a look around<br />&gt; G#7 G#m<br /> I guess Ive heard her words from underground, <br />&gt; C#m (lick)E - Ebm - C#m - B G#m F#m E<br />Shes gone for good<br /> <br />&gt; C#m A<br />Inspector Mills, isnt it a crime for a fool like me<br />&gt;F#m G#m A<br /> Tryin to use your time cause I wanna see, you just send me d bill<br />&gt; F#m C#m<br />Inspector Mills, Inspector Mills...<br /> <br />[Chorus III:]<br />&gt;C#m F#m<br /> I cant attempt to point you in her direction<br />&gt;B G#m C#m<br /> I didnt see her walkin out of the door<br />&gt;A E B<br /> If Id taken my time, shed be lyin here still<br />&gt; G#7 G#7<br />Inspector Mills, Inspector<br /> <br />[Chorus IV:]<br />&gt;C#m F#m<br />I cant attempt to point you in her direction<br />&gt;B G#m C#m<br /> I was blinded by the look in her eyes<br />&gt;A F#m<br /> If I had just followed through, then I wont be calling you <br />&gt; B<br />Hooh... ooh...<br /> <br />[Instrumental:]<br />&gt;C#m F#m; B G#m C#m;A E B G#7</p>\r\n<p>&gt;C#m A B</p>', 'foreign classic', 13, 'no', NULL, '', '2022-02-12 02:17:52', ''),
(796, 'I\'m just a kid', 274, '<p>[Intro]<br />&gt;D &ndash; G &ndash; A &ndash; G<br /> <br /> <br />[Verse]<br />&gt; D G<br />I woke up, it was seven<br />&gt; A G<br />Waited till eleven<br />&gt; D G A - G<br />Just to figure out that no one would call.<br />&gt; D G<br />I think I\'ve got a lot of friends<br />&gt; A G<br />But I don\'t hear from them.<br />&gt;D G A<br />What\'s another night all alone?<br />&gt; Em G A<br />When you\'re spending every day on your own<br /> <br />And here it goes ..<br /> <br /> <br />[Chorus]<br />&gt;D G A<br />I\'m just a kid and life is a nightmare<br />&gt;D G A G<br />I\'m just a kid and I know that it\'s not fair<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world<br />&gt;Em G A<br />Is havin\' more fun than me<br /> <br />Tonight<br /> <br /> <br />[Interlude]<br />&gt;D &ndash; G &ndash; A &ndash; G<br /> <br /> <br />[Verse]<br />&gt; D G<br />And maybe when the night is dead<br />&gt; A G<br />I\'ll crawl into my bed<br />&gt; D G A &ndash; G<br />Staring at these four walls again<br />&gt; D G<br />I\'ll try to think about the last time<br />&gt;A G<br /> I had a good time,<br />&gt; D G A<br />Everyone\'s got somewhere to go<br />&gt; Em G A<br />And they\'re gonna leave me here on my own<br /> <br />And here it goes<br /> <br /> <br />[Chorus]<br />&gt;D G A<br />I\'m just a kid and life is a nightmare<br />&gt;D G A G<br />I\'m just a kid and I know that it\'s not fair<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world<br />&gt;Em G A<br />Is havin\' more fun than me<br /> <br /> <br />[Bridge]<br />&gt;G<br />What the fuck is wrong with me?<br />&gt; A<br />Dont fit in with anybody<br />&gt;D A D G &ndash; D<br />How did this happen to me?<br />&gt;G A D<br />Wide awake, I\'m bored and I can\'t fall asleep<br />&gt; Em A<br />And every night is the worst night ever<br /> <br />&gt;D &ndash; G &ndash; A &ndash; G<br />I\'m just a kid (just a kid) x5<br /> <br /> <br />[Chorus]<br />&gt;D G A<br />I\'m just a kid and life is a nightmare<br />&gt;D G A G<br />I\'m just a kid and I know that it\'s not fair<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world is ..<br />&gt;Em G D A<br />Nobody wants to be alone and the world<br />&gt;D G A<br />I\'m just a kid and life is a nightmare<br />&gt;D G A G<br />I\'m just a kid and I know that it\'s not fair<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world is ..<br />&gt;Em G D A<br />Nobody wants to be alone in the world<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world is<br />&gt;Em G A<br />Having more fun than me, tonight<br /> <br />&gt;G &ndash; A &ndash; D &ndash; Bm &ndash; G &ndash; A &ndash; G<br />&gt;A&ndash;G<br />I\'m all alone ...Tonight<br />Nobody cares...</p>', 'emo', 5, 'no', NULL, '', '2022-02-12 02:17:52', ''),
(797, 'I\'d really love to see you tonight', 158, '<p>[Intro]<br /> <br />&gt;F FM7 F Bb<br /> <br />&gt;Gm C F<br />Hello, yeah, it\'s been a while.<br />&gt;Gm C F<br />Not much, how \'bout you?<br />&gt;Am Dm<br />I\'m not sure why I\'d call,<br />&gt; C C7<br />I guess I really just wanted to talk to you.<br /> <br /> <br />&gt;Gm C F<br />And I was thinkin\' maybe later on,<br />&gt;Gm C F<br />We could get together for a while.<br />&gt;Am Dm<br />It\'s been such a long time,<br />&gt; C C C C7<br />And I really do miss your smile.<br /> <br />[Chorus]<br />&gt;Bb C Am7<br />I\'m not talking \'bout moving in,<br />&gt; Bb C7 Am7 Dm<br />And I don\'t want to change your life.<br />&gt; BbM7 C<br />But there\'s a warm wind blowin\',<br />&gt; Am7 Dm C7sus F FM7 F Bb<br />The stars around, and I\'d really love to see you tonight.<br /> <br /> <br />&gt;Gm C F<br />We could go walking through a windy park,<br />&gt;Gm C F<br />Or take a drive along the beach.<br />&gt;Am Dm<br />Or stay at home and watch TV<br />&gt; Csus C C C<br />You see, it really doesn\'t matter much to me.<br /> <br /> <br />[Chorus]<br />&gt;Bb C Am7<br />I\'m not talking \'bout moving in,<br />&gt; Bb C7 Am7 Dm<br />And I don\'t want to change your life.<br />&gt; BbM7 C<br />But there\'s a warm wind blowin\',<br />&gt; Am7 Dm C7sus F <br />The stars around, and I\'d really love to see you tonight.</p>\r\n<p><br />&gt;Dm Am<br />I won\'t ask for promises,<br />&gt;Bb C F<br />So you don\'t have to lie.<br />&gt;Dm Am<br />We\'ve both played that game before,<br />&gt;C7sus C7<br />Say I love you, then say goodbye.<br /> <br /> <br />[Chorus]<br />&gt;Bb C Am7<br />I\'m not talking \'bout moving in,<br />&gt; Bb C7 Am7 Dm<br />And I don\'t want to change your life.<br />&gt; BbM7 C<br />But there\'s a warm wind blowin\',<br />&gt; Am7 Dm C7sus F <br />The stars around, and I\'d really love to see you tonight..<br /> <br />(Repeat Chorus while fading)</p>', 'foreign classic', 12, 'no', NULL, '', '2022-02-12 02:17:52', ''),
(798, 'Addicted', 274, '<p>&gt;C x2<br /> <br />&gt;C F G<br />&gt;C F G<br /> <br />[Verse]<br />&gt;C<br />I heard you\'re doing okay <br />&gt; F<br />But I want you to know<br />I\'m addict<br />&gt; C<br />I\'m addicted to you<br />I can\'t pretend I don\'t care<br />&gt; Dm Em F<br />When you don\'t think about me<br />Do you think I deserve this?<br /> <br />[Pre-Chorus]<br />&gt; Dm Em<br />I tried to make you happy <br />&gt; F G<br />but you left anyway<br /> <br />[Chorus]<br />&gt; C<br />I\'m trying to forget that<br />&gt; F C G<br />I\'m addicted to you<br />&gt; C<br />But I want it and I need it <br />&gt; F C G<br />I\'m addicted to you<br />&gt; Dm<br />Now it\'s over<br />&gt; G<br />Can\'t forget what you said<br />&gt; Dm G<br />And I never wanna do this again<br /> <br />[Post-Chorus]<br />&gt; F<br />Heartbreaker<br />&gt; C<br />Heartbreaker<br /> <br />&gt;F G C F G<br /> Heartbreaker<br /> <br />[Verse]<br />&gt;C<br />Since the day I met you <br />And after all we\'ve been through<br />&gt;F<br />I\'m still addict<br />&gt; C<br />I\'m addicted to you<br />I think you know that it\'s true<br />&gt; Dm Em F<br />I\'d run a thousand miles to get you<br />Do you think I deserve this?<br /> <br />[Pre-Chorus]<br />&gt; Dm Em<br />I tried to make you happy<br />&gt; F G<br />I did all that I could<br />&gt; Dm<br />Just to keep you<br />&gt; F G<br />But you left anyway<br /> <br />[Chorus]<br />&gt; C<br />I\'m trying to forget that<br />&gt; F C G<br />I\'m addicted to you<br />&gt; C<br />But I want it and I need it <br />&gt; F C G<br />I\'m addicted to you<br />&gt; Dm<br />Now it\'s over<br />&gt; G<br />Can\'t forget what you said<br />&gt; Dm G<br />And I never wanna do this again<br /> <br />[Post-Chorus]<br />&gt; F Em Dm C<br />Heartbreaker<br />&gt; F Em Dm G <br />Heartbreaker<br /> <br />[Bridge]<br />&gt;F Em Dm C<br />How long will I be waiting?<br />&gt;F Em Dm G<br />Until the end of time<br />&gt;F Em Dm C<br />I don\'t know