(805, 'Who\'s that Girl', 464, '<p>[Verse 1]<br />&gt; C<br />I was on the mic<br />&gt; Am7<br />Doin\' my thing on a friday night<br />&gt; Dm<br />Had the floor burning up just right<br />&gt; F G<br />Everybody was bumpin\', the club was jumping<br />&gt; C<br />Suddenly, you walked in<br />&gt; Am7<br />That\'s when everybody stopped dancing<br />&gt; Dm<br />And I couldn\'t stop myself staring<br />&gt; F G<br />Yeah I couldn\'t breathe, No I couldn\'t believe my eyes<br /> <br />&gt;C<br /> I never thought I\'d fall in love in a club<br />&gt;Am7<br /> But now I seen you girl I can\'t get enough<br />&gt;Dm<br /> With you I know there\'s no taking it slow<br />&gt;F G<br /> So can somebody please let me know<br /> <br />[Chorus]<br />&gt; C<br />Tell me who\'s that girl<br />Just walk walk (walk) in the club<br />&gt; Am<br />Tell me who\'s that girl<br />Just walk walk (walk) in the club<br />&gt; Dm<br />Tell me who\'s that girl<br />Just walk walk (walk) in the club<br />Just walk walk (walk) in the club<br />&gt; F<br />Just walk walk (walk), walk walk (walk), yeah</p>\r\n<p>[Verse II]<br />&gt; C<br />Before the night is through<br />&gt; Am7<br />Imma tell ya how I feel about you<br />&gt; Dm<br />And I know I got some work to do<br />&gt; F G<br />To make you believe that you should be leaving with me<br /> <br />&gt;C<br /> I never thought I\'d fall in love in a club<br />&gt;Am7<br /> The more I get of you, I can\'t get enough<br />&gt;Dm<br /> I won\'t be letting you leave here alone<br />&gt;F G<br /> So can somebody please let me know<br /> <br />[Chorus] x 2<br /> <br />[Eve]<br />E.V.E<br />&gt; C<br />I walk in the club it\'s over<br />All them other chicks might as well move over<br />&gt; Am7<br />Wanna know my name then you gotta get closer<br />Eyes on you too wanna get to know ya<br />&gt; Dm<br />Lemme run it down for ya, I\'m not easy<br />Some say caramel, you can call my evie<br />&gt; F <br />Wanna be the man in my life that please me<br />&gt;G<br />Gotta warn in, Once ya know me, you need me<br />&gt; C<br />Give you whip lash when I glide through the room<br />Five inch heels, watch how I move<br />&gt; Am7<br />Watch how I shake it to the beat, how I do<br />Know you wanna feel me, feel me shake it on you, yeah<br />&gt;Dm<br /> The night could get crazy<br />But I gotta hold back, I\'m a lady<br />&gt;F G<br />Well who knows maybe I could be your baby<br />Be your baby, be your baby<br /> <br />[Guy]<br />&gt; C<br />Wo-oh<br />&gt; Am7<br />Wo-oh oh<br />&gt; Dm<br />Wo-oh<br />&gt; F G<br />Wo-oh<br /> <br />[Chorus] x 2</p>', 'upbeat', 3, 'no', 'C', '', '2022-02-12 02:17:52', ''),
