 river<br />&gt;F#m<br />Lo ro lo le lo le<br />&gt;C#m<br />Lo ro lo le lo le<br />&gt;A B<br />At your feet... I\'m at your feet<br /> <br /> <br />[Chorus]<br />&gt;C#m A<br /> Whenever, wherever<br />&gt;E B<br /> We\'re meant to be together<br />&gt;C#m A<br />I\'ll be there and you\'ll be near<br />&gt;F#m B<br /> And that\'s the deal my dear<br />&gt;C#m A<br /> They\'re over, you\'re under<br />&gt;E B<br /> You\'ll never have to wonder<br />&gt;C#m A<br />We can always play by ear<br />&gt;F#m B<br /> But that\'s the deal my dear<br /> <br />&gt;C#m F#m B x2<br /> <br /> <br />[Bridge]<br />&gt;F#m C#m<br />Lo ro lo le lo le, lo ro lo le lo le-e-ee<br />&gt;A B<br />think out loud, say it again<br />&gt;F#m C#m<br />Lo ro lo le lo le lo le Tell me one more time<br />&gt;A B G#/B# N.C.<br />that you\'ll live lost in my eyes<br /> <br /> <br />[Chorus]<br />&gt;C#m A<br /> Whenever, wherever<br />&gt;E B<br /> We\'re meant to be together<br />&gt;C#m A<br />I\'ll be there and you\'ll be near<br />&gt;F#m B<br /> And that\'s the deal my dear<br />&gt;C#m A<br /> They\'re over, you\'re under<br />&gt;E B<br />You\'ve got me head over heels<br />&gt;C#m A<br /> There\'s nothing left to fear<br />&gt;F#m B<br /> if you really feel the way I feel<br /> <br />&gt;C#m A<br /> Whenever, wherever<br />&gt;E B<br /> We\'re meant to be together<br />&gt;C#m A<br />I\'ll be there and you\'ll be near<br />&gt;F#m B<br /> And that\'s the deal my dear<br />&gt;C#m A<br /> They\'re over, you\'re under<br />&gt;E B<br />You\'ve got me head over heels<br />&gt;C#m A<br /> There\'s nothing left to fear<br />&gt;F#m B<br /> if you really feel the way I feel<br /> <br /> <br />[Outro]<br />&gt;C#m F#m B C#m N.C.</p>', 'upbeat', 3, 'no', NULL, '', '2022-02-12 02:17:52', ''),
(807, 'Tick Tock', 465, '<p>&nbsp;</p>\r\n<p>&gt;Bb C Dm<br />Wake up in the mornin\' feelin\' like P Diddy (hey, what up girl?)<br />&gt;Bb C Dm<br />Grab my glasses, I\'m out the door, I\'m gonna hit this city (let\'s go)<br />&gt;Bb C Dm<br />Before I leave, brush my teeth with a bottle of Jack<br />&gt;Bb C Dm<br />\'Cause when I leave for the night, I ain\'t comin\' back</p>\r\n<p>[Refrain]<br />&gt;Bb<br />I\'m talkin\' pedicure on our toes, toes<br />&gt; C Dm<br />Tryin\' on all our clothes, clothes<br />&gt;Bb<br />Boys blowin\' up our phones, phones<br />&gt;Bb<br />Drop-toppin\', playin\' our favorite CDs<br />&gt;C Dm<br />Pullin\' up to the parties<br />&gt;Gm<br />Tryna get a little bit tipsy</p>\r\n<p>[Chorus]<br />&gt;Bb<br />Don\'t stop, make it pop<br />&gt;C Dm<br />DJ, blow my speakers up<br />&gt;Bb<br />Tonight, I\'ma fight<br />&gt; C Dm<br />\'Til we see the sunlight<br />&gt;Bb<br />Tick-tock on the clock<br />&gt;C Dm<br />But the party don\'t stop, no<br />&gt;Gm<br />Oh, whoa, whoa-oh<br />&gt;Dm C<br />Oh, whoa, whoa-oh</p>\r\n<p>&gt;Bb<br />Don\'t stop, make it pop<br />&gt;C Dm<br />DJ, blow my speakers up<br />&gt;Bb<br />Tonight, I\'ma fight<br />&gt; C Dm<br />\'Til we see the sunlight<br />&gt;Bb<br />Tick-tock on the clock<br />&gt;C Dm<br />But the party don\'t stop, no<br />&gt;Gm<br />Oh, whoa, whoa-oh<br />&gt;Dm C<br />Oh, whoa, whoa-oh</p>\r\n<p><br />[Repeat chords]<br />[Verse II]<br />Ain\'t got a care in the world, but got plenty of beer<br />Ain\'t got no money in my pocket, but I\'m already here<br />And now the dudes are linin\' up \'cause they hear we got swagger<br />But we kick \'em to the curb unless they look like Mick Jagger</p>\r\n<p>[Refrain]<br />I\'m talkin\' \'bout everybody gettin\' crunk, crunk<br />Boys try to touch my junk, junk<br />Gonna smack him if he gettin\' too drunk, drunk<br />Now, now, we go until they kick us out, out<br />Or the police shut us down, down<br />Police shut us down, down<br />Po-po shut us down</p>\r\n<p>[Repeat chorus]</p>\r\n<p><br />[Bride]<br />&gt;Bb Gm <br />DJ, you build me up You break me down<br />&gt;Dm C<br />My heart, it pounds Yeah, you got me<br />&gt;Bb Gm<br />With my hands up You got me now<br />&gt;Dm C<br />You got that sound Yeah, you got me<br />&gt;Bb Gm<br />DJ, you build me up You break me down<br />&gt;Dm C<br />My heart, it pounds Yeah, you got me<br />&gt;Bb<br />With my hands up<br />&gt;Gm<br />Put your hands up<br />Put your hands up</p>\r\n<p>[Stop]<br />Now, the party don\'t start \'til I walk in</p>\r\n<p><br />[Repeat chorus]</p>', 'upbeat', 3, 'no', 'Bb', '', '2022-02-12 02:17:52', ''),
(808, 'Starting over again', 466, '<p>&gt;C</p>\r\n<p>[Verse]<br /> <br />&gt; FM7 CAug/G# C - C7<br />And when I hold you in my arms I promise you<br />&gt; FM7 CAug/G# C - C7<br />You\'re gonna feel a love that\'s beautiful and new<br />&gt; F E7 Am G F#<br />This time I\'ll love you even better than I ever did before<br />&gt; G C<br />And you\'ll be in my heart forevermore<br /> <br />&gt;C F Dm E7 - E/G#<br />We, we\'re just too young to know we fell in love and let it go<br />&gt; Am G Dm D G<br />So easy to say the words goodbye, so hard to let the feelings die<br /> <br />&gt;C F Dm E7 - E/G#<br />I know how much I need you now, the time is turning back somehow<br />&gt; Am G Dm D <br />As soon as our hearts and souls unite<br />&gt; G C - Bb/G# Bb<br />I know for sure we\'ll get the feeling right<br /> <br /> <br />[Chorus]<br /> <br />&gt; Eb Ab Fm Bb Eb<br />And now we\'re starting over again, it\'s not the easiest thing to do<br />&gt;Cm Bb F/Am Bb<br />I\'m feeling inside again, \'cause every time I looked at you<br />&gt; Eb Eb/Gm Ab Fm Bb Eb<br />I know we\'re starting over again, this time we\'ll love all the pain away<br />&gt;Cm Bb F/Am Bb <br />Welcome home my lover and friend, we are starting over, over again<br /> <br />&gt;Dm G<br /> <br />&gt;C F Dm E7 - E/G#<br />If we never leave alone, and then we might have never known<br />&gt; Am G Dm D G C<br />All the times we spent apart, all we did was break each other\'s heart.<br /> <br /> <br />[Instrumental]<br /> <br />&gt;F- CAug/G#- C - C7 2x<br /> <br /> <br />[Verse]<br /> <br />&gt; Ab Abm Eb<br />And when I hold you in my arms I promise you<br />&gt; Ab Abm Eb<br />You\'re gonna feel the love that\'s beautiful and new<br />&gt; Ab G7 Cm Bb Am/F<br />This time I\'ll love you even better, than I ever did before<br />&gt; Bb Eb - C#<br />And you\'ll be in my heart forever more.<br /> <br /> <br />[Chorus]<br /> <br />&gt; F# B G#m C# F#<br />And now we\'re starting over again, it\'s not the easiest thing to do<br />&gt;Ebm C# Cm C#<br />I\'m feeling inside again, \'cause every time I looked at you<br />&gt; F# B G#m C# F#<br />I know we\'re starting over again, this time we\'ll leave all the pain away<br />&gt;Ebm C# Cm C# <br />Welcome home my lover and friend, we are starting over, over agaaaaaiin</p>\r\n<p>&nbsp;</p>\r\n<p>&gt; F# B G#m C# F#<br />I know we\'re starting over again, this time we\'ll leave all the pain away<br />&gt;Ebm C# Cm C# Eb, C# Cm <br />Welcome home my lover and friend, we are starting over, over agaaaaaiin</p>\r\n<p>&gt;G#m C# F#<br />We are starting over, over again</p>', 'foreign classic', 8, 'no', NULL, '', '2022-02-12 02:17:52', '');
