(815, 'Totoy Bibo', 470, '<p>[Intro]<br />&gt;G C G D G<br /> <br />[Verse]<br />&gt;G D C G Bm C G D G<br />[Bridge]<br />&gt;C Bm 2x Cm D<br /> <br />[Chorus]<br />&gt;G C<br />Ang galing, galing kong sumayaw galing kung gumalaw<br />&gt; G D<br />galing kung sumayaw, galing kung gumalaw galing kung sumayaw<br />&gt; G<br />bibong-bibong gumalaw.<br /> <br />[Verse 1]<br />&gt;G D<br />Nung bata pa ako tinuruan ako nang lolo nang tango<br />&gt;C G<br />Paso doble, boogie, chacha, ang tinuro nang tatay ko<br />&gt;Bm Am<br />Pinag sama-sama ko at ngayon ako\'y bibong-bibo<br />&gt;G D G<br />Kaya ang tawag nila sa akin totoy bibo.</p>\r\n<p><br />[Repeat chorus]<br /> <br />[Verse 2]<br />&gt;G D<br />Lagi akong niyaya tuwing may pistang bentang-benta<br />&gt;C G<br />Lahat napapatingin sakin pag ako\'y sumayaw na<br />&gt;Bm Am<br />Its a bird its a plane only its only me<br />&gt;G D G<br />Remember M remember E remember ME totoy bibo.</p>\r\n<p>[Repeat chorus]<br /> <br />[Bridge]<br />&gt;C Bm Am G<br />Di ko mapigilang yumugyog ako sa tugtog<br />&gt;C Bm Am D<br />Lahat sila\'y napapasabay kay totoy bibo<br />&gt; Eb<br />Kay totoy bibo.</p>\r\n<p>[Key up +1]<br />[Repeat chorus]</p>', 'upbeat', 3, 'no', 'G', '', '2022-02-12 02:17:52', ''),
