n na iwanan sya<br />&gt; D A F#m G<br />Ang dami-DAmi naman diyang ibA<br />&gt; D A F#m G<br />Wag kang mangangambang baka wala ka nang ibang Makita<br /> <br /> <br />[PRE-CHORUS]<br /> <br />&gt; G D A<br />Na lalake na magmahal sayo<br />&gt; G D Bm A<br />At hinding hindi nya sasayangin ang pag-ibig mo<br /> <br /> <br />[CHORUS]<br /> <br />&gt; D G Bm A<br />Sa libu-libong pagkakataon na tayoy nag-kasama<br />&gt; D G Bm A<br />Iilang ulit palang kitang nakitang masaya<br />&gt; D G Bm A<br />Naiinis akong isipin na ginaganyan ka ya<br />&gt; D G Bm<br />Siguro ay hindi niya lang alam ang iyong<br />&gt; A D<br />Tunay na halaga<br /> D<br />Sa libo-libong pagka<br /> <br /> <br />[SOLO]<br /> <br />&gt;D G Bm A<br />&gt;D G Bm A<br />&gt;D G Bm A<br />&gt;D G Bm A<br /> <br /> <br />[BREAK]<br /> <br />&gt; Bm D A<br />Minsan hindi ko maintindihan<br />&gt; Bm D G A<br />Parang ang buhay natin ay napagti-tripan<br />&gt; Bm D A <br />Medyo Malabo yata ang mundo<br />&gt; G D Bm A<br />Binabasura ng iba ang siya\'y pinapangarap ko<br /> <br /> <br />[CHORUS]<br /> <br />&gt; D G Bm A<br />Sa libu-libong pagkakataon na tayoy nag-kasama<br />&gt; D G Bm A<br />Iilang ulit palang kitang nakitang masaya<br />&gt; D G Bm A<br />Naiinis akong isipin na ginaganyan ka ya<br />&gt; D G Bm<br />Siguro ay hindi niya lang alam ang iyong<br />&gt; A D<br />Tunay na halaga<br />&gt; D<br />Sa libo-libong pagka<br /> <br /> <br />[OUTRO]<br /> <br />&gt;D A Bm A D A Bm A D</p>', 'opm rock', 14, 'no', NULL, '', '2022-02-12 02:17:52', ''),
(824, 'Silvertoes', 474, '<p>[Verse] (Drums)<br /> <br />N.C.<br />Wag ka nang mag-alala<br />N.C.<br />hinding hindi ako in love sa yo<br />N.C.<br />bakit ba pakiramdam mo pa yata<br />N.C.<br />lahat kami ay naaakit mo<br />N.C.<br />miss miss pakitigil lang please<br />N.C.<br />ang iyong pagpapantasya<br />N.C.<br />hindi ka na nakakatuwa<br />N.C.<br />papagulpi na kita sa gwardyang may batuta<br /> <br />&gt;G Em C D<br />ha ya ya ya...<br /> <br /> <br />[Verse]<br /> <br />&gt;G Em C D<br />Hindi ko talaga ma-gets<br />&gt;G Em C D<br />kung bakit ka ganyan<br />&gt;G Em C D<br />ang feeling moy sabik sa iyo<br />&gt;G Em C D<br />ang lahat ng kalalakihan<br />&gt;G Em C D<br />sorry pagpasensyahan mo na<br />&gt;G Em C D<br />mali talaga ang iyong inaakala<br />&gt;G Em C D<br />lahat kami ay nandidiri sa iyo<br />&gt;G Em C D<br />ikaskas mo na sana ang mukha mo sa simento<br /> <br /> <br />[Verse]<br /> <br />&gt;G Em C D<br />Di kami na tu-turn-on<br />&gt;G Em C D<br />sa kutis mong kulay champurado<br />&gt;G Em C D<br />di kami naaakit<br />&gt;G Em C D<br />sa labi mong garamucho<br />&gt;G Em C D<br />IVoh please naman pakitanggap mo nalang ang katotohanan<br />&gt;G Em C D<br />naganyan ka pinanganak<br />&gt;G Em C D<br />wag ka nang magpapanggap<br />&gt;G Em C D<br />na ikaw ay isang dalagang ubod nang ganda<br />&gt;G Em C D<br />kahit na alam naman natin na ang karakas mo<br />&gt;G Em C D<br />ay ubod nang sama<br /> <br /> <br />[Instrumental]<br /> <br />&gt;G Em C D<br />&gt;G Em C D<br />&gt;Em C G D <br />&gt;Em C G D <br /> <br />[Verse] (Drums)<br /> <br />N.C.<br />siguro nga naman ay may mga mas pangit pa sa yo<br />N.C.<br />pero at least hindi sila nagpapacute katulad mo<br />N.C.<br />nakakabadtrip ka nakakairita twing kitay nakikita<br />N.C.<br />di ko alam bat ang laki ng ulo mo<br />N.C.<br />magingat ingat ka baka ikaw ay sagasaan ko<br /> <br />Repeat III and IV<br />Repeat IV and ends with hayayaya:<br />&gt;G Em C D)</p>', 'opm rock', 14, 'no', NULL, '', '2022-02-12 02:17:52', ''),
(825, 'Akala koy langit', 475, '<p>Akala Ko\'y Langit<br /> <br />[Intro]</p>\r\n<p>&gt;E C#m F#m B<br />&gt;E E [pause]</p>\r\n<p><br />[VERSE 1]<br /> <br />&gt; A<br /> At tinangay ka na ng hangin<br />&gt; B E<br /> papalayo sa akin<br />&gt; A<br /> wala nang iisipin<br />&gt; B E<br /> kahibangan ko\'y natapos din<br /> <br /> <br />[REFRAIN 1]<br />&gt; C#m G#m C#m <br /> nasanay na akong magulo ang mundo<br />&gt; C#m G#m <br /> nasanay na akong malayo sayo<br />&gt; A G#m C#m<br /> wala na kahit pa maganda mong alaalang nakakapit<br />&gt; A B B B B E pause<br /> aalisin ko na rin ang larawan mong nakasabit<br /> <br /> <br />[VERSE 2]<br /> <br />&gt; A<br /> At tinangay na rin ng usok<br />&gt; B E<br /> naglaho na at may tuldok<br />&gt; A<br /> di na makakapasok<br />&gt; B E<br /> tapos na ako sa pagsubok<br /> <br /> <br />[REFRAIN 2]<br /> <br />&gt; C#m G#m C#m <br /> Alam ko nang may tama ang mali<br />&gt; C#m G#m <br /> alam ko nang ang sobra\'y may sukli<br />&gt; A G#m C#m<br /> dahil ang isang katulad mo\'y liwanag na marikit<br />&gt; A B B B B <br /> at ako ang gamu-gamu na sa iyo\'y napalapit<br /> <br /> <br /> <br /> [Chorus]<br /> <br />&gt; E<br /> Akala ko\'y langit<br />&gt; C#m<br /> bakit ang init<br />&gt; F#m<br /> lagi na lang nag aakala <br />&gt; B<br /> dahil sa pagtitiwala<br />&gt; E<br /> akala ko\'y langit<br />&gt; C#m<br /> bakit ang init<br />&gt; F#m<br /> huli man daw ang pagsisisi<br />&gt; B E pause<br /> may umaga naman pagtapos ng gabi<br /> <br /> <br />[Solo]</p>\r\n<p>&gt;A - B - E<br />&gt;A - B - E</p>\r\n<p>&nbsp;</p>\r\n<p><br /> <br />[REFRAIN 2]<br /> <br />&gt; C#m G#m C#m <br /> Alam ko nang may tama ang mali<br />&gt; C#m G#m <br /> alam ko nang ang sobra\'y may sukli<br />&gt; A G#m C#m<br /> dahil ang isang katulad mo\'y liwanag na marikit<br />&gt; A B B B B <br /> at ako ang gamu-gamu na sa iyo\'y napalapit<br /> <br /> <br /> <br /> <br /> [Chorus]<br /> <br />&gt; E<br /> Akala ko\'y langit<br />